      ANALIST: "Özgür Şafak Açıkalın",
      ACIKLAMA_TR:
        "\"<p><b> Yatırım Teması </b></p><br> \n\n<p> Pandemi döneminde alınan önlemlerin getirdiği tüketim kaybı ve sert rekabet bira segmentinde hem büyümeyi hem de marjları olumsuz etkiledi. Ayrıca artan girdi maliyetlerinin alım gücündeki zayıflama ve rekabet nedeniyle fiyatlara aynı oranda yansıtılamaması operasyonel kar marjlarını baskıladı. Pandemi ile ilgili kısıtlamaların kalkması ve hayatın normale dönmesiyle talepte bir miktar toparlanma olmakla birlikte özellikle Türkiye’de alım gücündeki düşüşün hacimleri olumsuz etkilemeye devam edeceğini öngörüyoruz. Yılın 3. çeyreğinde toplam bira segmentinde hacimlerde yıllık bazda %4 artış bekliyoruz. En önemli pazar olan Rusya‘da pazarın büyümesi ve pazar payı kazanımının etkisi ile uluslararası operasyonların hacimlerinin orta tek haneli büyüyeceğini ancak alım gücündeki düşüş nedeni ile Türkiye bira hacimlerinde zayıf baza rağmen daralma olacağını öngörüyoruz. Hacim büyümesinin yanısıra fiyat artışları ve TL'nin değer kaybının da etkisi ile bira segmentinde 3. çeyrekte yıllık bazda %33 satış büyümesi göreceğimizi tahmin ediyoruz. Ancak güçlü büyümeye rağmen hammadde maliyetlerindeki ciddi artış ve kur etkisi nedeni ile marjlarda baskı göreceğimizi ve FAVÖK marjının yıllık bazda 350 baz puan daralacağını öngörüyoruz (bira segmenti FAVÖK'te yıllık bazda sınırlı %7 artış bekliyoruz). 9 aylık tahminlerimiz bira segmentinde Şirket'in 2021 yılına ilişkin düşük tek haneli hacim büyümesi, kur çevrim farkının etkisinden arındırılmış olarak düşük onlu satış büyümesi ve 200 baz puan marj daralması beklentilerine uygun gelişiyor. Yalnızca son çeyrekteki maliyet baskısına bağlı olarak marj tarafında hafif aşağı yönlü risk olabileceğini düşünüyoruz.  </p><br> \n\n<p><b>Riskler </b></p><br> \n\n<p> Girdi maliyetlerinde artış ve sert rekabet nedeni ile marj tarafındaki baskının önümüzdeki yıl da en önemli risk faktörlerinden biri olarak öne çıkacağını öngörüyoruz.  </p><br>\"",
      ACIKLAMA_ENG:
        '"Investment Case\n The fierce competition, especially in Russia and loss of consumption in all markets due to the measures taken during the pandemic period adversely affected both growth and operational margins in beer segment. In addition, input costs pressures not fully reflected into prices due to weakening purchasing power and competition, suppressed operational profit margins. With the removal of the restrictions related to the pandemic and normalization of the life, we expect recovery in demand, but declining purchasing power will continue to negatively affect volumes, especially in Turkey. In the third quarter of the year, we expect a 4% YoY increase in volumes in total beer segment; in Russia, we estimate the volumes to grow by mid-single digit driven by the market growth and market share gains, whereas in Turkey we expect volumes to contract despite the weak base due to the decrease in purchasing power. We estimate 33% annual sales growth in beer segment in Q3, driven by the volume growth, price increases and Fx conversion impact of the international operations. However, despite the strong growth, we expect margins to be under pressure due to the significant increase in raw material costs and Fx impact. We foresee EBITDA to grow by only 7% YoY in Q3 along with 350bps margin deterioration YoY in beer segment. Our forecasts for the full year are roughly in-line with the Company\'s full year guidance of low single-digit volume growth and low teens Fx neutral sales growth in beer segment. On margin front, we think there might be a slight downside risk to 200bps YoY margin contraction guidance of the Management due to the expected further cost pressures in Q4. \n\n\nKey risks\n\nWe anticipate that further pressures on margins will stand out as the most important risk factor in 2022 due to the increasing raw material prices, fierce competition and deteriorating purchasing power. \n"',
