      ANALIST: "Ezgi Akalan",
      ACIKLAMA_TR:
        "\"<p>Arçelik yılın üçüncü çeyreğinde 716mn TL net kar açıkladı. Geçen yılın yüksek bazı ve zayıflayan operasyonel performansı nedeniyle, net kar yıllık bazda %31 düşüş gösterdi. Konsolide gelirler 3Ç21'de 18.15 milyar TL olarak gerçekleşti. Aşılanmanın hızlanması ve ekonomilerin yeniden açılması ile tüm pazarlarda talepte gözlemlenen normalleşmeye rağmen, yapılan fiyat artışları, Hitachi ve Whirlpool Manisa Fabrikası satın almalarından kaynaklanan inorganik hacim büyümesi ve zayıf TL sayesinde net satışlar yıllık bazda %52 büyüme kaydetti. Satın almaların olumlu etkisi hariç tutulduğunda, organik gelir büyümesi yıllık %29 olarak gerçekleşti. 3Ç21’de FAVÖK 1,78 milyar TL olarak gerçekleşti ve yıllık bazda %3 artış gösterdi (satın almalar hariç %24 artış). FAVÖK marjı ise 3Ç20’de kaydedilen %14.5 seviyesinden %9,8 (satın almalar hariç %10,4) seviyesine geriledi. Satın almalar marjlar üzerinde azaltıcı etkide bulunurken, yüksek hammadde fiyatları ve düşük kapasite kullanım oranın yarattığı marj baskısı fiyat artışları ve sıkı faaliyet gideri kontrolüyle kısmen telafi edildi.\n\nArçelik, 2021 konsolide gelir büyümesi beklentisini bir önceki beklentisi + %30'dan (TL bazında) yaklaşık %55'e revize etti. Yönetim Türkiye operasyonlarında yıllık %35 büyüme (daha önce % 25) ve uluslararası operasyonlarda ise yıllık +%35 büyüme (önceki beklenti +%10) öngörüyor. Uluslararası gelir beklentilerinde meydana gelen değişiklik, Hitachi ve Whirlpool satın almalarının hesaplamaya dahil edilmesinden kaynaklanmıştır. 2021 FAVÖK marjı beklentisi ise, satın alınan şirketlerin marjlarının düşük olması nedeniyle önceki beklenti %12'ye kıyasla %11'e revize edildi. 2021 yatırım harcamaları ve işletme sermayesi / satış oranı beklentileri değiştirilmedi, sırasıyla 220 mn EUR ve %25 olarak tutuldu.\n\n2021’de şirketin konsolide satış gelirlerinde ve FAVÖK rakamında sırasıyla %57 ve %33 artış öngörüyoruz. 2021’de hammadde maliyetlerindeki artış trendi ve güçlü baz yılı nedeniyle FAVÖK marjında 1.8 puan gerileme bekliyoruz.\n </p><br>  \n<p><b>Katalizör</b></p><br>  \n<p>Hitachi ve Whirpool satın almalarının Şirket’in büyümesine katkı sunacağını düşünüyoruz. Hitachi satın alımı ile Şirket Hitachi'nin güçlü marka bilinirliği ve potansiyel sinerjilerden faydalanarak Asya Pasifik bölgesindeki varlığını arttırmayı ve küresel genişleme stratejisini desteklemeyi hedefliyor. Whirlpool satın alımı ile Şirket mevcut çamaşır makinası ve soğutucu kapasitesini %20 arttırmayı ve  Whirlpool’un Avrupa'da faaliyet gösteren şirketlerine ürün satışı yaparak pazar payını genişletmeyi planlamaktadır. Şirket'in devam etmekte olan hisse geri alım programı hisse performansını destekleyecektir.\n</p><br>  \n<p><b>Riskler</b></p><br>  \n<p> (i) Beklentimizden daha zayıf Türkiye ve Avrupa TV ve beyaz eşya pazarları; (ii) kar marjlarını olumsuz etkileyecek hammadde fiyatlarındaki artış; (iii) Avro’nun ve TL’nin ABD Doları karşısında değer kaybetmesi; ARCLK tavsiyemiz için önde gelen risk unsurladır. . </p><br>\"",
      ACIKLAMA_ENG:
        "<p><b>Investment Case</b></p><br>\n\n<p> Arcelik is increasing its presence in global appliance market thanks to organic and inorganic growth prospects in international markets. The Company is well set for growth in the long term thanks to its strong market share of 50% in domestic market, geographically diversified operations such as Europe, Asia and Africa, operating markets with low penetration rates offering promising future growth such as Pakistan, India and Bangladesh. We project Arcelik’s consolidated revenues to grow at CAGR of 19% in TL terms for the next ten years. The Company projects its long-term term EBITDA margin as 12%.  </p><br>\n\n<p><b>Catalyst</b></p><br>\n\n<p> Potential slowdown in domestic demand following the end of incentive package at the end of June, seasonal increase in WCR as 2Q & 3Q are the peak seasons in domestic market, appreciation of $ against TL and € hurting operating margins (majority of raw material purchases in US$)  and negative cash flow estimate for 2019 are the negatives for the stock.  We believe that negatives are mostly in stock price considering the stock’s attractive multiple. On the other hand, easing raw material prices and extension of incentive packages in domestic market are the catalysts in the short-term.</p><br>\n\n<p><b>Valuation</b></p><br>\n\n<p> Our PT of 23.7TL based on the combination DCF (75%) and international peers’ (25%) offers a hefty upside potential.  </p><br>\n\n<p><b>Key risks</b></p><br>\n\n<p> (i) weaker than expected Turkish and European home appliance market ; (ii) higher raw material prices, putting pressure on margins ; (iii) weakness in TL and € against US$ ; (iv) increasing political tension in Turkey - EU relations resulting in a suspension in Turkey EU memberships talks and a potential distortion in trade and economic relations are the major risks to our call.\n</p><br>",
