      ACIKLAMA_TR:
        "<p><b> Yatırım Teması </b></p><br>\n<p> Son yıllardaki savunma sanayindeki yerlilik oranının artırılması çabalarına dayanarak uzun vadede askeri harcamaların bütçedeki payının aynı seviyelerde kalacağını düşünüyoruz. Aselsan'ın mevcut bakiye siparişlerinin %82'sini döviz bazlı sözleşmeler oluşturuyor. ASELSAN'ın maliyetinin büyük çoğunluğu Türk Lirası kaynaklı. Artan kur sebebiyle, bakiyelerde TL bazlı sözleşmelerin ağırlığının artması ihtimali var. 2022 yılında, bu seneye paralel olarak yeni sözleşmelerin değerinin yaklaşık 2 milyar dolar civarında olmasını bekliyoruz.  Şirket alt yüklenicilerine ödeme yapmaya devam etse de devlet kurumlarından alacakların tahsilatında süreler uzuyor. Ayrıca 2023 yılındaki genel seçimlere kadar askeri harcamalarda kısıntıya gidilebilme ihtimali de mevcut. Ukrayna’daki savaş sonrasındaki dönemde NATO üyelerinin savunma harcamalarının artabileceğini ve Türkiye’nin jeopolitik öneminin güçleneceğini ve bu durumun savunma sanayisinin uzun vadeli görünümünü destekleyeceğini düşünüyoruz. .Şirketin 2022 yılını da net borç pozisyonunda kapatabileceğini ancak net borç pozisyonunun 2023 yılı artıya geçebileceğini ve sonrasında iyileşmeye devam edeceğini tahmin ediyoruz.  \n  </p><br>\n<p><b> Riskler ve Katalizörler </b></p><br>\n<p> Yakın coğrafyada meydana gelen çatışmalar Aselsan’ın ürünlerine olan talebi artırabilir. Özellikle tek seferlik gelirler kısa vadede artabilir. Ayrıca sözleşmelerin çoğu döviz bazlı olduğundan, TL'nin değer kaybetmesi ciro artışını destekleyebilir ve marjların güçlü kalmasına yardımcı olabilir. Şirket için potansiyel riskler: artan işletme sermayesi ihtiyacı, TL bazlı sözleşmelerin artan payı, zayıf serbest nakit akışı yaratımı. \n. <b> <p><b> Riskler </b></p><br>\n<p>  </p><br>",
