        '"<p><b> Yatırım Teması </b></p><br>\n\n\n<p> Güçlü yeni mağaza açılışları ve özellikle Mart ayının ortasından itibaren COVID-19 salgını sebebiyle sepet büyüklüklerinin artması, Türkiye’nin en büyük gıda perakende zinciri Bim’in büyümesini oldukça olumlu etkiledi. COVID-19 etkisinin hissedilmeye başladığı Mart ayını da içinde bulunduran 1Ç20’de satışlarını %40 artıran Şirket, hızlı mağaza açılışlarının yanısıra hem güçlü sepet büyümesi ve hem de görece yüksek müşteri trafiği ile en yakın benzerinden 7,6 puan daha yüksek benzer mağaza büyümesi gösterdi. Salgının tüketim davranışlarını etkilemesi ile beklenenden çok daha güçlü büyüme gösteren şirket, mevcut belirsizlikler nedeniyle 2020 beklentilerinde herhangi bir değişikliğe gitmedi. Ancak hızlı yeni mağaza açılışları, oldukça güçlü sepet büyümesi ve görece güçlü kalan müşteri trafiği sayesinde Şirket’in öngörülerini aşacağını ve ikinci çeyrek sonuçları ile birlikte büyüme öngörülerinde yukarı yönlü revizyon yapacağını düşünüyoruz. Operasyonel karlılığın da Şirket’in 2020 yılı öngörülerinin üst bandına yakınsayacağını düşünüyoruz.\n </p><br>\n\n\n<p><b> Katalizör </b></p><br>\n\n\n<p> Yılın geri kalanında da güçlü büyüme ve artan karlılık trendinin devam etmesi ve 2Ç20 finansalları sonrası Şirket’in öngörülerinde yukarı yönlü revizyon en önemli katalizörler olarak öne çıkıyor. </p><br>\n\n\n<p><b> Riskler </b></p><br>\n\n\n<p>Sektörde artan rekabet en önemli risk faktörü olarak öne çıkıyor. </p><br>"',
