      ACIKLAMA_TR:
        "<p><b>Yatırım Teması</b></p><br> \n\n<p> Doğuş Otomotiv için yurtiçi otomotiv pazarındaki liderliğinin ve güçlü araç parkının en önemli güçlü yanları olduğunu düşünüyoruz. Nitekim güçlü pazar payı TL’nin değer kaybının keskin olduğu dönemde gecikmeli de olsa gerekli fiyat artışları için şirketin elini kuvvetlendiren bir unsur. Diğer taraftan geçmişte de olduğu gibi kurdaki sert değer kayıplarında VW Grubu’nun Doğuş Otomotiv’e destek vermeyi sürdüreceğini düşünüyoruz.  </p><br> \n\n<p><b>Katalizör</b></p><br> \n\n<p> Salt ithalatçı distribütör olarak sadece iç pazardaki talep koşullarına bağımlı olan Doğuş Otomotiv 1Y20’de faizlerdeki gerileme ve düşük baz yılı etkisiyle çarpıcı büyüme kaydeden otomotiv satışlarından en fazla fayda sağlan oyuncu oldu. Şirket 1Y20’de %42 hacim büyümesi ve sıkı gider kontrolü ile elde ettiği güçlü operasyonel performans ve faiz oranlarındaki gerileme kaynaklı finansman giderlerindeki düşüş sayesinde 1Y19’da kaydettiği 44 milyon TL net zarar rakamına karşın 1Y20’de 229  milyon TL net kar rakamı açıkladı. Doğuş Otomotiv’in ürün gamının çoğunlukla orta – üst segmentten oluşmasından dolayı ÖTV artışından en fazla olumsuz etkilenen sektör oyuncularının başında geleceğini düşünüyoruz. Her ne kadar kuvvetli Temmuz ve Ağustos satışlarıyla 3Ç20’de yıllık bazda büyüme devamını beklesek de 4Ç20’de şirket finansallarında sınırlı da olsa gerileme bekliyoruz. Borçlanma oranlarındaki artışın finansman giderlerine ve net kar rakamına olumsuz etkisinin daha çok 2021’de hissedileceğini düşünüyoruz. 2021’de binek araçlarda ürün karması değişikliğinden (üst ÖTV diliminden alta kayış amaçlı)  dolayı binek araç başına satış gelirlerinde düşüş olabileceğini düşünüyoruz ki bu da karlılığı olumsuz etkileyecektir. Tüm bunların ışığında güçlü geçen 2020’nin ardından 2021 yılında Doğuş Otomotiv’in FAVÖK rakamında yıllık bazda %6 net kar rakamında ise %17 düşüş hesaplıyoruz.</p><br>\n DOAS için 16.35TL hedef fiyatımız ile TUT tavsiyemizi koruyoruz. Doğuş Otomotiv için %60 kar dağıtım oranı tahminimizle, 2020 karından 2021’de 275 milyon TL temettü dağıtacağını öngörüyoruz.</p><br> \n\n<p><b>Riskler</b></p><br> \n\n<p> Faiz oranlarında düşüş, TL'nin Euro'ya karşı değer kazanması, ekonomik aktivitedeki hızlanma, yurtiçi otomotiv satışlarını hızlandırabilecek potansiyel devlet teşvikleri hisse için yukarı yönlü riskler. Öte yandan, tüketici güvenini sarsan jeopolitik ve politik riskler, ekonomide beklenenden daha yavaş toparlanma, yüksek faizli ortamı, TL'deki değer kaybıyla artan araç fiyatları sektör için olumsuz risklerdir. p><br>",
