      ANALIST: "Sinem Cango",
      ACIKLAMA_TR:
        "\"<p><b>Yatirim Teması</b></p><br>  \n<p>Satış hacmini güçlü iç talep destekliyor Erdemir, genel imalat, otomotiv ve beyaz eşya sektörlerinin yanı sıra dağıtım zincirlerinden gelen güçlü iç talep sayesinde 2021 yılının ilk altı ayında yıllık bazda %2 artışla 4.023 milyon ton satış hacmi elde etti. Erdemir’in yurt içi müşterilerinin çoğunun küresel iyileşmeden yararlanan ihracatçılar olduğunu hatırlatmak isteriz. Şirket, 3-4 aylık bakiye siparişlerinin şimdiden dolduğunu ve satış hacimlerinin güçlü seyrettiğini belirtti. Ek olarak, firmanın döviz cinsinden gelirleri zayıf TL’ye karşı avantaj yaratıyor.\nYüksek çelik fiyatları karlılığı olumlu etkiliyor Yüksek seyreden çelik fiyatları önümüzdeki çeyreklerde Erdemir’i olumlu etkilemeye devam edecek. Erdemir’in sözleşmeli satış fiyatları ile spot fiyatlar arasında 3 aylık bir gecikme olduğunu hatırlatmak isteriz. Erdemir’in ortalama satış fiyatının %55 artarak 2020’de gerçekleşen 542 dolar/ton’dan 2021’de 842 dolar/ton’a çıkmasını öngörüyoruz. Haziran ayına kadar artarak devam eden ve Haziran’da en yüksek seviyesini gören çelik fiyatları ile her çeyrek rekor bir bilanço açıklayan Erdemir’in 2022 yılında cazip bir temettü ödemesini bekliyoruz.  2022 yılı temettü verimi tahminimiz ise %21’e işaret ediyor. \n3Ç21’de ton başına FAVÖK önceki çeyrekte ulaşılan rekor marjın da üzerinde gerçekleşecek Erdemir’in ana maliyet kalemi olan demir cevheri, Mayıs ayı içerisinde 230$/ton seviyelerine ulaşmış olsa da şu an 125$/ton seviyelerinde seyrediyor. Erdemir’in hammadde dağılımının %47 demir cevheri, %24 kömür olduğunu belirtmek gerekirse ;  kömür fiyatlarındaki artış demir cevheri fiyatlarındaki düşüş  tarafından kısmen dengeleniyor. Satış  fiyatlarının 3 ay, maliyetlerin ise  4-5 ay geriden gelmesi sebebiyle  rekor  fiyat seviyelerinin yansımalarını önümüzdeki dönemlerde görmek mümkün. Bu sebeple 3Ç21'de ton başına FAVÖK'ün önceki çeyrekte ulaşılan rekor marjı da geçerek 383 dolara yükselmesini bekliyoruz. ( Bir önceki çeyreğe göre %14 artış). Çin’in çelik sektörüne üretim ve ihracat kısıtlamaları getirmesi  sonucu demir cevheri  fiyatlarındaki düşüş  marjları destekliyor.  Çin’in üretim ve ihracat kısıtlamalarının Türk çelik üreticilerine ihracat pazarlarında alan açabileceğini düşünüyoruz. Öte yandan uluslararası pazarlarda arzı azaltacak bu durum fiyatarı da destekleyebilir. \n </p><br>  \n<p><b>Katalizör</b></p><br>  \n<p> Erdemir için önceki 24.10TL hedef fiyatımızı makro tahminlerimizdeki güncelleme ile 22.55 TL’ye güncelliyoruz ve AL tavsiyemizi koruyoruz. Hedef fiyatımız %20’lik yukarı yönlü potansiyele işaret ediyor. 2022 tahminlerimize göre Erdemir hisseleri 5,36x F/K ve 3,25x FD/FAVÖK çarpanları ile işlem görüyor. Bu çarpanlar şirketin uluslararası benzerlerine göre sırasıyla %5 ve %17’lik ıskonto oranlarına  işaret ediyor.\n. </p><br>  \n<p><b>Riskler</b></p><br>  \n<p> Hisse için en önemli risk faktörleri, çelik fiyatlarında beklentimizden önce hızlı bir düşüş ve/veya  hammadde  fiyatlarında beklentilerimiz üzerinde artışlar. \n  p><br>\"",
      ACIKLAMA_ENG:
        "\"<p><b>Investment Case</b></p><br>\n\n<p> Strong domestic demand supports sales volume. Erdemir achieved a sales volume of 6.15 mn tons, remained flat on yearly basis. Thanks to strong domestic demand from the manufacturing, automotive and white goods sectors as well as distributional channels, sales volume continued its strong performance. We would like to remind you that most of Erdemir’s domestic customers are exporters benefiting from the global recovery. The company stated that 3-4 month orders are already filled and strong sales volume will continue for the upcoming quarters. In addition, company benefits from the depreciation of TL against US$ since its functional currency is US$.\nHigh steel prices is the main driver for improved profitability. With its leading position in the sector, the company benefited from the continuation of the increase in steel prices.  We would like to remind you that there is a two-month delay between Erdemir's contract sales prices and spot prices. We expect Erdemir's average sales price to increase by 55% from US$542/ton in 2020 to US$842/ton in 2021. \n </p><br>\n\n<p><b>Catalyst</b></p><br>\n\n<p> Record high margin achieved in 3Q21 Erdemir achived a record high EBITDA margin of 40.7% in 3Q21, benefiting from high steel prices. EBITDA per ton came in at US$404ton in 3Q21 and exceed record high margin achieved in 2Q21 (3Q20: 117$/ton; 2Q21: 336$/ton). Erdemir's main cost item, iron ore, reached US$230/ton in May, but is currently around US$125/ton. It should be noted that iron ore and coal account for respective 47% and 24% of Erdemir’s total raw material costs. That’s why we think that the increase in coal prices might be partially offset by the decline in iron ore prices. It is possible to see the reflections of record price levels in the coming periods, as sales prices are 3 months behind and cost prices are 4-5 months behind. The decline in iron ore prices supports margins as China imposes production and export restrictions on the steel industry. We think that China's production and export restrictions may open up space for Turkish steel producers in export markets. This situation, which will reduce the supply in international markets, may also support prices.\n p><br>\n\n<p><b>Valuation</b></p><br>\n\n<p> We maintain our BUY recommendation We revise our target price for Erdemir from TL25.10 to TL22.55 with the revisions in our macro estimates and we maintain our BUY recommendation. Our target price points to 13% upside potential. According to our 2022 estimates, Erdemir shares are trading at par with its 2022E 5.7x P/E but trading at 10% discount with its 2022E 3.4x EV/EBITDA multiple compared to its international peers. Decline in steel prices, earlier than our expectations and higher level of iron ore prices, squeezing margins are the major risks for our price target and projections. With steel prices that continued to increase until June and reached their highest level in June, we think that Erdemir, which comes with a better balance sheet every quarter, will offer attractive dividend opportunities in 2022. Our 2022 dividend yield forecast points to 19%.\n  p><br>\n\n<p> . p><br>\n\n\n<p><b>Key risks</b></p><br>\n\n<p> Major risks can be counted as i) Trade wars affecting global steel demand negatively, (ii) Additional protective measures by EU on Turkish steel exports. p><br>\"",
