      ACIKLAMA_TR:
        '"<p><b>Yatırım Teması</b></p><br>  \n<p> Ford Otosan’ı yeni yatırımların etkisi ile güçlü büyüme potansiyeli, açıkladığı elektrikli araç yatırımı ile yine Türkiye otomotiv sanayiindeki öncü konumunu koruması, Avrupa’da hafif ticari araç pazarındaki lider pozisyonu, yüksek ihracat gelirleri (cironun yaklaşık %75’i), güçlü bilançosu ve yüksek temettü verimi nedeniyle beğeniyoruz. Çip tedarikindeki sıkıntıların global otomotiv sanayide 2022 ortasına kadar devam etmesini bekliyor, ancak diğer taraftan global çip krizindeki tedarik sıkıntısının hisse fiyatına büyük çoğunlukla yansıdığını düşünüyoruz. Yüksek ihracat gelirleri (75% pay) ile Ford Otosan’ın TL’deki değer kaybından fayda sağlayacağını düşünüyoruz. </p><br>  \n<p><b>Katalizör</b></p><br>  \n<p>Şirket 2021 yılında 450 – 500 milyon euro yatırım bütçesi planlıyor. Ford Otosan’ın 2021 ile 2026 yılları arasında yeni jenerasyon Transit ailesi modelleri, Ford – Volkswagen işbirliği kapasite artışı ile elektrikli araç ve batarya yatırımlarını kapsayan yaklaşık 2.3 milyar euro’luk ağır yatırım döngüsüne gireceğini hatırlatmak isteriz. Ford Otosan 2021 yılı için önceki 80 bin adet yurtiçi satış hacmi,  307 bin ihracat hacim adeti bekliyoruz.  2021 yılında Ford Otosan’ın %40 FAVÖK ve %60 net kar büyümesi elde edeceğini hesaplıyoruz. \n</p><br>  \n<p> FROTO için  (%50 -€ bazlı-İNA; %50 çarpan analizi) 244.50TL hedef fiyatımız ile  hisse için AL tavsiyesi veriyoruz.</p><br>  \n  \n<p><b>Riskler</b></p><br>  \n<p> Öncelikle Avrupa otomotiv pazarında olabilecek daralma ve Türkiye otomotiv talebini olumsuz etkileyecek kur ve faiz artışlarının şirketin faaliyetleri açısından önemli risk unsurları olduğunu düşünüyoruz.p><br>"',
      ACIKLAMA_ENG:
        "<p><b>Investment Case</b></p><br>\n\n<p> High share of exports (ca70%) in revenues, secured cost + mark-up export margins, room for higher CURs and margin improvement, continuation of solid dividend payments as the investment cycle is completed and strong domestic market share in domestic LCV segment are  the  major  investment positives for the stock.</p><br>\n\n<p><b>Catalyst</b></p><br>\n\n<p> Ford Otosan will propose gross dividends of TL800mn (TL2.28/share) in the AGM to be held on March, 19th.</p><br>\n\n<p> The dividend yield corresponds to 3.7%. Our total dividend payment estimate of TL1.1bn for 2018 implies TL317mn payment as 2nd tranche in November pointing out  1.5% dividend yield.</p><br>\n\n<p> In terms of 2018 outlook,  we project  19% top-line growth driven by 2%  volume  growth, price increases and positive currency impact. EBITDA growth is forecasted as 20% in 2018. </p><br>\n\n<p><b>Valuation</b></p><br>\n\n<p> Our blended (DCF: 75% & In. Peers: 25%) PT is TL57.90 per share. The stock trades at premium with its 2018E  EV/EBITDA of 9.8x  compared to international peers’ average of 6.8x.p><br>\n\n<p><b>Key risks</b></p><br>\n\n<p> Better than expected growth in European automotive market boosting company’s exports, any cut in SCT in the domestic auto market or lower auto loan rates to stimulate domestic demand would be the upside potential risks for the stock. On the other hand, weaker-than-expected domestic and European LCV markets,  tougher pricing and market share competition in domestic market than anticipated putting pressure on domestic margins, lower-than expected cash dividend distribution, higher than expected raw material prices putting pressure on domestic margins, sharp currency changes and any tax hikes on auto sales are the downside risks.p><br>",
