      ACIKLAMA_TR:
        "<p><b> Yatırım Teması </b></p><br> \n<p> Dolaylı biçimde Koza Altın’ın %45’ini elinde bulunduran Koza Anadolu Metal’in %52’sine sahip olan İpek Enerji, Koza Altın’a yatırım yapmak isteyen yatırımcı için bir alternatif. 31 Aralık 2018’de Türkiye Petrolleri ile bir operatörlük anlaşması imzalayan şirket, şu anda yalnızca kendisine ait 2 kuyu ve TPAO’nun 6 kuyusundan çıkan petrolün satışını gerçekleştiriyor. Anlaşma kapsamında toplam 8 kuyudan çıkan petrolden elde edilen gelirlerin %9,6’sını alan şirket, maliyetlere de ortak oluyor. Yeni kuyuların açılması ihtimalinde de maliyetlere payı oranında katılması halinde aynı oranda gelirden pay alabiliyor.  2018 yılında 8.091 varil petrol satan şirket bu satıştan 2.4 milyon TL’lik bir gelir elde etti. Anlaşmanın etkin olduğu 2019 yılında ise 10.124 varil petrol satıldı. </p><br> \n\n<p><b> Katalizör </b></p><br> \n<p> Finansallar bakımından iştiraki Koza Anadolu Metal’den pek de farklı olmayan İpek Enerji, operasyonel anlamda da zayıf kalıyor. Petrol operasyonlarının TPAO ile birleştirilmesi ve bu operasyonlardan alınan %9,6’lık payın finansallara önemli bir etkisini görmüyoruz. İştiraki Koza Anadolu’ya göre piyasada iskontolu işlem gören şirketi pahalı buluyoruz. Koza Altın ile alakalı gelişmeler şirketin hisse performansını etkileyebilir.</p><br> \n\n<p><b> Riskler </b></p><br> \n<p> Temel risk faktörleri Koza Altın için belirlediklerimizden oluşmakta: Söğüt madeninin işletilmesi, Mollakara’daki potansiyel kaynakların ekonomik değeri bulunan ölçülmüş ve belirlenmiş (M+I) kaynaklar kategorisine geçmesi, yeni madenlerin açılması/bulunması ve altın fiyatlarındaki beklenmedik hareketler.</p><br>",
