      ONCEKI_TARIH: "30.11.2021 00:00:00",
      ONCEKI_ONERI_ID: "3",
      ONCEKI_ONERI_ACIKLAMA: "GÖZDEN GEÇİRİLİYOR",
      ONCEKI_ONERI_ACIKLAMA_ENG: "UNDER REVIEW",
      ONCEKI_FIYAT: "0",
      ANALIST: "Sinem Cango",
      ACIKLAMA_TR:
        '"<p><b>Yatirim Teması</b></p><br>  \n<p>Tepe noktasını gören çelik fiyatları karlılığı destekledi Haziran ayında yıl içindeki en yüksek noktasını gören çelik fiyatlarının hızlı yükselişi ile Kardemir’in karlılığında önemli iyileşme sağlandı. 2021’in ilk yarısında yüksek seyreden operasyonel karlılık, 2Ç21 itibariyle net borcun kapanması, riskten korunma muhasebesine geçişle birlikte 2021 yılı için yüksek gelmesi beklenen karlılık ; 2019’dan beri temettü dağıtmayan şirkete temettü  için iyi bir zemin oluşturuyor. 2022 yılı için temettü verimi tahminimiz ise %10’a işaret ediyor. Alınan siparişlerin 1.5 ay kadar teslimat süresi olması sebebiyle Haziran ayından itibaren düşen çelik fiyatlarının etkisinin ağırlıklı olarak  önümüzdeki dönemlerde görülmesini, 3. çeyreğe ise kısmen yansımasını bekliyoruz. Kardemir’in hammadde dağılımı %44 demir cevheri, %31 kömür olarak gerçekleşiyor. Hızla yükselen kömür fiyatlarının etkisinin firmanın stoklu çalışması ve daha önceden yapılan kontratlar sayesinde 3. çeyrekte sınırlı olmasını, 4. çeyrekte hissedilmesini bekliyoruz. Demir cevheri fiyatlarındaki düşüşün ise daha çok yıllık kontratla çalışılması ve daha az oranda spot alım yapılması sebebiyle sene başında hissedilmeye başlayacağını düşünüyoruz. Kardemir için 2021 ortalama çelik satış fiyatı tahminimizi önceki 573$/ton’dan 721$/ton’a yükseltiyoruz. Çelik fiyatlarında başlayan düşüş ve kömür fiyatlarındaki artışın kısmi etkisi ile 3Ç21 için ton başına FAVÖK tahminimiz 228 dolar olup, bir önceki çeyreğin %7 altında.\nSatış hacminin 2020 yılına paralel olacağını öngörüyoruz 1Y21’de 1Y20’ye büyük ölçüde paralel 1.182 bin ton satış gerçekleşti. Mevcut talebin devam etmesinin etkisiyle 2021 yılı için geçen yıla paralel 2,3 milyon tonluk satış hacmi öngörüyoruz. \n   </p><br>  \n<p><b>Katalizör</b></p><br>  \n<p> Kardemir için çelik/demir cevheri fiyat tahminlerimizdeki revizyon ve güncellenen makro projeksiyonlarımız ile hedef fiyatımızı hisse başına 9,77TL’den 11,20TL’ye yükseltiyor, AL tavsiyemizi koruyoruz. Yeni hedef fiyatımız %55 yukarı yönlü potansiyele işaret ediyor. Hisse 2022 tahminlerimize göre yurtdışı benzerlerine göre sırasıyla %28 ve %39’luk iskontoya işaret eden 4.0x F/K ve 2.4x FD/FAVÖK çarpanlarıyla işlem görüyor. \n. </p><br>  \n<p><b>Riskler</b></p><br>  \n<p>Çelik fiyatlarında beklenenden hızlı gerçekleşebilecek bir gevşeme ve /veya hammadde fiyatlarında beklentimizin üzerinde artışlar en önemli risk unsurları.\n.  \n  p><br>"',
      ACIKLAMA_ENG:
        '"<p><b>Investment Case</b></p><br>\n<p> Rising steel prices have supported profitability  With the rapid rise in steel prices, which hit their highest point in June throughout the year, resulted in a significant improvement in Kardemir\'s profitability. Strong operational profitability thanks to rising steel prices, net cash position (as of 2Q21) and the transition to hedge accounting  limiting f-x losses are expected to be the main drivers for strong earnings momentum for 2021. Since the orders received have a delivery time of 1.5 months, we expect the effect of the falling steel prices since June to be seen in the coming periods and to be partially reflected in the 3Q21. The iron ore and coal account for respective 44% and 31% of Kardemir’s total raw material costs. We expect the impact of the rapidly rising coal prices to be limited in the 3Q21 and to be seen in the 4Q21, thanks to the stock management of the company and the previous contracts. We think that the sharp decline in iron ore prices will be more visible in early 2022 due to higher share of contracted supply purcahses. We are increasing our 2021 average steel sale price estimate for Kardemir to US$721/ton from the previous US$573/ton. Our EBITDA per ton estimate for 3Q21 is $228 per ton, 7% lower than the previous quarter, due to the decline in steel prices and the increase in coal prices.\n</p><br>\n<p><b>Catalyst</b></p><br>\n<p></p><br>\n<p>. </p><br>\n<p> Sales volume is expected to be flattish in 2021 Company’s total sales volume was realized at 1.182k tons in 1H21, similar to 1H20. We anticipate a sales volume of 2.3 million tons for 2021 similar to 2020. \n. </p><br>\n<p><b>Valuation</b></p><br>\n<p> We maintain our BUY recommendation. With the revision of our steel/iron ore price estimates for Kardemir and our revised macro projections, we increase our target price from TL9.77 to TL11.20 per share, and we maintain our BUY recommendation. Our new target price points to 48% upside potential. The stock is traded at deep discount with its 2022E 2.4x P/E and 1.5x EV/EBITDA multiples compared to its international peers’ median of 5.5x and 3.7x, respectively. Decline in steel prices earlier than our expectations and higher level of iron ore prices squeezing margins are the major risks for our price target and projections. We project 14% dividend yield for 2022 thanks to strong eranings momemntum in 2021.\n. p><br>\n<p><b>Key risks</b></p><br>\n<p> Major risks can be counted as higher than anticipated increase at raw material prices, contraction in global or local demand and prices, and weaker TL.p><br>"',
