      ACIKLAMA_TR:
        '"<p><b>Yatırım Teması</b></p><br>\n\n<p> Pazardaki güçlü konumu, büyüme potansiyeli ve tekrar eden gelirlerin toplam gelirler içerisindeki yüksek payı (%64) nedeniyle Logo’yu beğenmeye devam ediyoruz. İlk çeyrekte de güçlü ivmesini sürdüren  coin gelirlerindeki artışın, ileriye dönük olarak Şirket’in yüksek görünürlük sunan tekrar eden gelirlerinin büyüme potansiyelini arttıracağını düşünüyoruz. Yazılım sektörünün büyüme dinamiklerinden faydalanan Logo’nun, benzerlerine göre oldukça düşük yazılım penetrasyonuna sahip olan Türkiye’deki güçlü pazar konumunun Şirket için iyi bir büyüme hikâyesi sunduğuna inanıyoruz.  LOGO için hisse başına 52.0 TL hedef fiyatımız ile AL tavsiyemizi sürdürüyoruz. \n\n </p><br>\n\n\n\n<p><b>Katalizör</b></p><br>\n\n<p> Şirket yönetimi, yıl başında paylaştığı beklentilere göre, 2021 yılında 728mn TL satış geliri, (+%34), 260mn TL FAVÖK (+%47) ve 196mn TL vergi öncesi kar (+66%) öngörüyor. FAVÖK marjının ise %33’ten %36’ya yükselmesi bekleniyor. Yılın ikinci çeyreğinde güçlü performansını devam ettiren Türkiye operasyonları ve Romanya faaliyetlerindeki önemli iyileşme sayesinde oldukça dikkat çekici sonuçlar açıkladı. Şirket’in bu güçlü performansını özellikle güçlü ivmesini sürdüren coin gelirleri ve TL’deki değer kaybı nedeniyle yılın ikici yarısında da devam ettirmesini bekliyoruz. Bu beklentiler doğrultusunda 2021’de Şirket’in %38 ciro ve %52 FAVÖK büyümesi kaydetmesini bekliyoruz. Net karda ise FAVÖK’teki pozitif sapma beklentimize ek olarak, kur farkı gelirlerindeki artış ve yılın ilk yarısında kaydedilen tek seferlik gelirler ile birlikte yıllık bazda %84 artış öngörüyoruz. Hızlanan dijitalleşme süreci, ekonomik aktivitedeki toparlanma ile birlikte Romanya’daki proje edinimlerinde meydana gelmesi beklenen artış, TL’nin değer kaybı, yüksek görünürlük sunan tekrar eden gelir modeli ve güçlü bilanço yapısı ile Şirket’in 2022 yılında da güçlü sonuçlar açıklamaya devam etmesini bekliyoruz.\n.</p><br>\n\n\n\n<p><b>Riskler</b></p><br>\n\n<p> Şirket için yakın vadeli önemli gördüğümüz risk unsurlarını, i) e-devlet hizmetlerinde yüksek fiyat rekabeti nedeniyle şirketin Pazar payında azalma, ii) Türkiye ekonomisinde 2021 yılında beklentilerimizin altında büyüme iii) Romanya’daki proje işlerinin beklentilerimizden daha uzun süre ertelenmesi, olarak sıralayabiliriz. \n P><br>"',
      ACIKLAMA_ENG:
        "<p><b>Investment Case</b></p><br>\n<p> LOGO is one of the most lucrative software companies in Turkey given high revenue growth, strong market position, and significant expansion potential. LOGO is the leading provider of Enterprise Application Software for SMEs. In terms of market share in Turkey Enterprise Application Services sales, LOGO placed second with 24%, following market leader SAP. Logo acquired Total Soft, supplier of ERP systems in Central Europe and one of the top 10 global providers of software solutions for the leasing industry, in September in 2016 to expand its international footprints. However, operational turn around in Total Soft could be delivered so far, in which has diluted consolidated margins significantly and let to major underperformance of the stock.  p><br>\n\n<p><b>Catalyst</b></p><br>\n<p> Possible turnaround in Total Soft might be major catalyst for the company.  </p><br>\n\n<p><b>Key risks</b></p><br>\n<p> Slower than expected growth of GDP in Turkey may postpone or reduce IT investments of the companies, especially SMEs. Therefore, an economic slowdown could reduce revenue growth and our earnings estimates, resulting in lower profitability.</p><br",
