      ACIKLAMA_TR:
        "<p><b> Yatırım Teması </b></p><br>\n\n\n<p> Türkiye’nin en büyük süpermarket zinciri olan Migros, COVID-19 sebebiyle değişen tüketim alışkanlıklarından büyüme anlamında oldukça olumlu etkilendi. Hem ortalama sepet büyüklüğündeki artış hem de özellikle pandemi döneminde talep patlaması yaşayan online satış kanalı büyümeyi destekleyen en önemli unsurlar oldu. Online satış kanalına uzun yıllardır önemli yatırımlar yapan Şirket, doğal olarak COVID sonrası artan talepten de en çok yararlanan oyuncu oldu. Nitekim Migros Sanalmarket üzerinden verilen sipariş miktarı, COVID-19 sonrası dönemde dört katına yükseldi. Bu üçlü büyüme sayesinde online satış kanalının toplam cirodaki payının 2020 yılında %10’a ulaşacağını düşünüyoruz. Ayrıca online satış kanalındaki büyümenin sadece bu yıl değil, COVID-19 sonrası dönemde de güçlü kalmaya devam edeceğini ve Şirket’in büyüme hızını  destekleyeceğini düşünüyoruz. Güçlü operasyonel nakit akışı ile birlikte devam eden gayrimenkul satışları, Şirket’in Euro bazlı borçlarının önemli ölçüde azalmasına yardımcı oluyor. Düşük faiz ortamında devam etmesini beklediğimiz gayrimenkul satışları ile borç geri ödemesinin hızlanmasının hisse performansını olumlu yansımaya devam edeceğini düşünüyoruz. </p><br>\n\n\n<p><b> Katalizör </b></p><br>\n\n\n<p> Yılın geri kalanında da güçlü büyüme ve artan karlılık trendinin devam etmesi, gayrimenkul portföyünün satışı ile birlikte döviz borçluluğun beklenenden daha hızlı azaltılması, TL’nin değer kazanması veya faizlerin düşmesi ile birlikte karlılığın artması en önemli katalizörler olarak öne çıkıyor. </p><br>\n\n\n<p><b> Riskler </b></p><br>\n\n\n<p> Şirket’in halen yüksek Euro cinsi borcu en önemli risk unsuru olarak öne çıkıyor. </p><br>",
      ACIKLAMA_ENG:
        "<p><b>Investment Case</b></p><br>\n<p> Operating in supermarket segment, Migros is in a better position compared to the discounters due to the higher growth potential and relatively lower competition in our view. We expect 19% topline CAGR with average 6.3% EBITDA margin in next 2-years (exc. Kipa). The acquisition of Kipa will further boast the growth and strengthen the market position of the Company. </p><br>\n<p><b>Catalyst</b></p><br>\n<p> The continuation of strong growth and market share gains, the turnaround of recently acquired Kipa stores and partial divesture of Kipa’s real estate assets (which generate roughly TL60mn of rental income) may be short-midterm triggers for the shares.</p><br>\n<p><b>Valuation</b></p><br>\n<p> Anadolu Group has purchased Migros’s 40.25% stake at TL26.86/share back in July’15 and 9.25% stake at 30.2/share in May’17. The discount of shares to last transaction stands at 23%. The share currently trades at 6.9x 2018 EV/EBITDA multiple suggesting 28% discount to its international peers. </p><br>\n<p><b>Key risks</b></p><br>\n<p> High euro denominated debt is the major concern for Migros. Net debt position stands at TL2.3bn (debt: TL3.6bn) as of end-2Q17. 2017E Net debt/EBITDA ratio stands at 2.3x. Migros’s short euro position of c.€700mn creates a significant Fx risk for the Company. </p><br>",
