        '"<p><b>Yatırım Teması</b></p><br>\n\n\n<p> Otokar hem savunma sanayi hem de ticari araç ürün gamı ile dengeli bir ürün portföyüne sahiptir. </p><br>\n\n\n<p><b>Katalizör</b></p><br>\n\n\n<p> Otokar’ın 9A21 sonu itibariyle 8X8 ve 4X4 taktik zırhlı araç siparişlerinden oluşan toplam 2.05 milyar TL bakiye siparişi bulunuyor. Şirket yüksek döviz gelirleri sayesinde (60%-70%) TL’deki değer kaybından fayda sağlamaktadır. \n </p><br>\n\nOTKAR için çarpan analizi ile ulaştığımız hisse başına 351.0TL hedef fiyatımız sınırlı getiriye işaret ettiğinden SAT tavsiyemiz bulunuyor. Otokar için %50 kar dağıtım oranı tahminimizle, 2021 karından 2022’de 385 milyon TL temettü dağıtacağını öngörüyoruz.  Potansiyel askeri zırhlı araç siparişleri hisse için katalizör olabilir\n</p><br>\n\n\n<p><b>Riskler</b></p><br>\n\n\n<p> Zayıf yurtiçi otomotiv talebi ve savunma sanayi ihalelerinin/siparişlerinin öngörülebilirliği olmaması da hisse için olumsuz etkendir. .p><br>"',
      ACIKLAMA_ENG:
        "Our PT for OTKAR doesn't include potential serial production of Altay MBT project.",
