      ANALIST: "Defne Başustaoğlu",
      ACIKLAMA_TR:
        "<p><b> Yatırım Teması </b></p><br>\n<p>Talep ve ürün fiyatları güçlü seyrine devam ediyor: Artan talep ve arz sıkışıklıkları kaynaklı olarak petrokimya ürün fiyatları özellikle de Petkim için önemli olan polimer fiyatları yılın ikinci yarısında da güçlü seyrini devam ettirdi. Ürün fiyatları için gösterge niteliğindeki etilen fiyatı yıllık bazda %59 artarken çeyreklik bazda %4 artarak dördüncü çeyrekte ortalama 1246$/ton olarak gerçekleşti. Ekonomilerin toparlanması, arz sıkışıklıkları, yüksek ulaştırma maliyetleri, tedarik zincirindeki kırılmalar ve genel olarak enerji fiyatlarındaki artış ile petrokimya ürün fiyatlarının yüksek seyri yılın son çeyreğinde de devam etti. Maliyet tarafında artan baskıya rağmen ürün karlılıkları güçlü seyrini koruyor: Petrol fiyatlarındaki artış ile nafta fiyatları da yükselmeye devam ediyor. Petkim’in faaliyetlerine olumsuz yansıyan bu etkinin yükselen ürün fiyatları sayesinde kısmen telafi edileceğini öngörüyoruz. Petkim’in karlılığı için gösterge niteliğindeki etilen-nafta fiyat makası yıllık bazda %29 artarken çeyreklik bazda sadece %3’lük bir düşüş ile dördüncü çeyrekte ortalama 527$/ton olarak gerçekleşti. Petkim’in döviz bazlı gelir akışını, avantajlı maliyet mekanizmasını, artan karlılığını ve azalan borçluluk oranlarını beğeniyoruz. 2022 Ocak itibariyle doğal gaz fiyatlarına yapılan zam ve ardından Botaş tarafından doğal gaz kullanımına getirilen kısıtlama Petkim’in karlılığını olumsuz yönde etkileyebilir. Bununla birlikte, Petkim’in 1 Şubat itibariyle doğal gaz tedarikini doğrudan Azeri gazından Socar’a özel bir tarifeyle sağlayacak olması olumsuz etkileri sınırlayabilir. </p><br>\n\n<p><b> Katalizör </b></p><br>\n<p>Ekonomilerde küresel ölçekte olumlu gidişat ile birlikte tedarik zincirindeki kırılmalar, yüksek navlun maliyetleri ve arz sıkışıklıkları, ürün karlılıkları ve dolayısıyla da hisse performansı için en önemli katalizörler olarak öne çıkıyor. </p><br>\n\n<p><b> Riskler </b></p><br>\n<p>Değerlememize yönelik en önemli risk unsurlarını ise, küresel ekonomik büyümenin zayıflaması, artan hammadde maliyetlerinin ürün fiyatlarına beklenilen ölçüde yansıtılamaması olarak sayabiliriz.</p><br>",
      ACIKLAMA_ENG:
        '"<p><b>Investment Case</b></p><br>\n\n<p>  Demand and product prices continue to be strong: Due to the increasing demand and supply shortages, petrochemical product prices, especially polymer prices, which are important for Petkim, continue their strong course in the second half of the year. Ethylene price, which is an indicator for product prices, averaged around US$1203/ton in the third quarter, posting 74% YoY growth and down just 3% QoQ. We believe the strong momentum of petrochemical product prices will continue to be intact in the last quarter of the year due to the recovery of the economies, supply shortages, high transportation costs and increasing energy prices in general.\nDespite the increasing pressure on cost side, product profitability remains strong: With the increase in oil prices, naphtha prices also continue to rise. We anticipate that the negative impact of increasing naphtha prices on Petkim’s profitability will be partially compensated by rising product prices. We expect operational profitability, which reached a record level in Q2, will start to normalize in 2H21 due to rising costs. However, due to the strong product prices, operational profit will likely be above our initial expectations. Our current forecasts point to upside risk to the Company\'s EBITDA guidance for 2021.\n  </p><br>\n\n<p><b>Catalyst</b></p><br>\n\n<p>  </p><br>\n\n<p><b>Valuation</b></p><br>\n\n<p> We value the company based on sum of the parts analysis, which includes DCF based target valuation for its petrochemical business and Petlim, in which Petkim has a 70%stake. We have used a combination of DCF and peer comparison analysis, for the petrochemical business. p><br>\n\n<p><b>Key risks</b></p><br>\n\n<p> Major risks can be counted as (i) global recession negatively affecting petrochemical prices (ii) narrowing product and naphta spread, due to supply/demand imbalances. p><br>"',
