      ACIKLAMA_TR:
        '"<p><b>Yatırım Teması</b></p><br>  \n<p> 2019 Aralık ayında ilk Çin’in Wuhan şehrinde ortaya çıkmasının ardından Şubat ayından itibaren tüm dünyaya yayılan Covid-19 salgınından en erken ve en derin etkilenen sektör havacılık sektörü oldu. Aşılanma oranlarındaki hızlı ilerleme hükümetlere sınırları yeniden açma bireylere ise seyahat etme konusunda güven veriyor. Gelişmiş ekonomilere kıyasla dünyanın daha yavaş aşı dağıtımına sahip bölgelerinde (gelişmekte olan ekonomiler ve Asya Pasifik\'teki bazı gelişmiş ekonomiler) havacılık endüstrisinin toparlanmasının daha uzun sürmesi bekleniyor. 2022’de iyileşme devam etse de havacılıkta 2019 seviyeleri 2023’de yakalanacak .  </p><br> \n<p><b>Katalizör</b></p><br>  \n<p> Pegasus Havayolları yönetimi 2021’de 2019 yılı iç hat kapasitesinin %95-%100’üne, dış hat kapasitesinin ise %65-%70’ine ulaşmayı planlıyor, toplamda ise 2019’un %70-%75’ine ulaşmayı hedefliyor. Havayolunun filosu 2021’de 7 adet yeni uçak girişi, 9 uçak çıkışı ile 90 adete ulaşacak. 4Ç21’de 4Ç19 kapasitesinin %84’ünü kullanacağı tahminimizle, Pegasus Hava Yolları’nın 2021 yılında 2019’daki kapasitesinin %74’üne  ulaşacağını hesaplıyoruz. 2021 için 20.25 milyon yolcu sayısı tahminimiz ise 2019’daki seviyesinin %66’sına denk geliyor. Pegasus Hava Yolları 2021’de için 943 milyon € (önceki : 798 milyon €) satış geliri ve 188 milyon € (önceki: 162 milyon €) FAVÖK rakamı öngörüyoruz.\nPegasus Havayolları için 2022 yılında ise 2019 kapasitesinin %90’ına ulaşacağını öngörüyoruz. 2022’de havayolu için 1.34 milyon € satış geliri ve 340 milyon € FAVÖK tahmin ediyoruz. 2022’de jet yakıt maliyetlerinin artmasına rağmen dış hat yolcu payının artmasıyla FAVÖK marjında yüzde 5.3 artış bekliyoruz.\n\n</p><br> \nPGSUS’u 2022 – 2023 yıllarının ortalama düzeltilmiş FAVÖK rakamını kullanarak 6.0x Firma Değ./FAVÖK çarpanı ile değerliyoruz. PGSUS için hisse başına 121.80TL hedef fiyatımız ile AL tavsiyemizi bulunuyor.Aşılanma hızı, yeni ilaç ve tedavi yöntemleri ile ilgili haberlerin önümüzdeki dönemde hisse performansında etkili olabileceğini düşünüyoruz.\n<p><b> Riskler </b></p><br>\n \n<p> Terör saldırıları gibi havayolu seyahat talebini olumsuz etileyecek dışsal gelişmeler, salgının beklentilerden uzun sürmesi,  beklentilerden daha düşük birim gelirler, petrol fiyatlarındaki artış ve yolcu trafiğinin beklentilerden daha düşük gerçekleşmesi hisse için önemli risklerdir.    p><br>"',
