      ACIKLAMA_TR:
        '"<p><b>Yatırım Teması</b></p><br>  \n<p> 2019 Aralık ayında ilk Çin’in Wuhan şehrinde ortaya çıkmasının ardından Şubat ayından itibaren tüm dünyaya yayılan Covid-19 salgınından en erken ve en derin etkilenen sektör havacılık sektörü oldu. Aşılanma oranlarındaki hızlı ilerleme hükümetlere sınırları yeniden açma bireylere ise seyahat etme konusunda güven veriyor. Gelişmiş ekonomilere kıyasla dünyanın daha yavaş aşı dağıtımına sahip bölgelerinde (gelişmekte olan ekonomiler ve Asya Pasifik\'teki bazı gelişmiş ekonomiler) havacılık endüstrisinin toparlanmasının daha uzun sürmesi bekleniyor. 2022’de iyileşme devam etse de havacılıkta 2019 seviyeleri 2023’de yakalanacak. TAVHL’ın pandemi sonrası dönemdeki toparlanmadan en fazla fayda sağlayacak havacılık şirketi olmasına karşın, petrol fiyatlarındaki artıştan, rekabetin uçak bileti ücretleri üzerinde yaratabileceği baskıdan etkilenmeyecek olmasını önemli bir avantaj olarak görüyoruz. Seyahat sınırlamaları kaldırıldığında çoğunlukla kısa mesafeli ve keyfi (leisure) destinasyon uçuşlarına ev sahipliği yapan TAV Havaalanlarının pandemi sonrasındaki toparlanmaya hızlı tepki vereceğini düşünüyoruz. </p><br> \n<p><b>Katalizör</b></p><br>  \n<p> TAV’ın toplam yolcu sayısının 2020’deki 27 milyondan 2021’de 50.9 milyona artacağını öngörüyoruz. 2021 yılı için TAV’ın 493 milyon € satış geliri (önceki 451milyon €) ve 166 milyon € FAVÖK (önceki 76 milyon €) elde edeceğini tahmin ediyoruz. Şirketin 2020’deki 285 milyon € net zarar rakamına kıyasla 2021’de 40 milyon € net kar rakamı kaydedeceğini hesaplıyoruz. \n\n</p><br> \nTAVHL için parçaların toplamı değerleme methoduyla hesapladığımız  hisse başına   35.05TL hedef fiyatımız ile AL tavsiyemizi koruyoruz. Aşılanma hızı, yeni ilaç ve tedavi yöntemleri ile ilgili haberlerin önümüzdeki dönemde hisse performansında etkili olabileceğini düşünüyoruz.\n</p><br>  \n <p><b> Riskler </b></p><br>\n<p> Terör saldırıları gibi havayolu seyahat talebini olumsuz etileyecek dışsal gelişmeler, beklentilerden daha düşük birim gelirler, petrol fiyatlarındaki artış ve yolcu trafiğinin beklentilerden daha düşük gerçekleşmesi hisse için önemli risklerdir.    p><br>"',
      ACIKLAMA_ENG:
        "Investment Case\n\n\n\nTAV’s revenues composed of EUR - 54%, TL - 26%, USD - 18% and other currencies - 2%. On the other hand, operational expenses currency breakdown includes TL - 60%, USD - 20%, EUR - 10% and other currencies - 9%. TAV naturally has a long position in EUR and a short position in TL. Even though the company hedges some of the currency exposures, TAV benefits from the weaker TL against EUR\n\n\n\nCatalyst\n\n\n\nThe upcoming airport tenders in Cuba and Philippines, recovery in the tourism figures and better than expected performance of service companies may act as a catalyst.\n\n\n\nValuation\n\n\n\nFollowing the release of 3Q16 results and slightly improving outlook, we changed our estimates. We believe, transit/transfer passenger will continue to be the main driver for the international traffic growth. Our 2016E revenue estimate slightly increased to EUR 1,091mn from EUR 1,064 and 2016E EBITDA increased to EUR 451mn from EUR 441mn. \n\n\n\n\n\nKey risks\n\n\n\nThe biggest risk is the early closure of Ataturk Airport due to the completion of Third Airport. Even though SAA gave a guarantee of full compensation as a result of early closure, lower than expected compensation amount may be determined.",
