        "\"<p><b>Yatırım Teması</b></p><br>  \n<p> 2019 Aralık ayında ilk Çin’in Wuhan şehrinde ortaya çıkmasının ardından Şubat ayından itibaren tüm dünyaya yayılan Covid-19 salgınından en erken ve en derin etkilenen sektör havacılık sektörü oldu. Aşılanma oranlarındaki hızlı ilerleme hükümetlere sınırları yeniden açma bireylere ise seyahat etme konusunda güven veriyor. Gelişmiş ekonomilere kıyasla dünyanın daha yavaş aşı dağıtımına sahip bölgelerinde (gelişmekte olan ekonomiler ve Asya Pasifik'teki bazı gelişmiş ekonomiler) havacılık endüstrisinin toparlanmasının daha uzun sürmesi bekleniyor. 2022’de iyileşme devam etse de havacılıkta 2019 seviyeleri 2023’de yakalanacak.  </p><br> \n<p><b>Katalizör</b></p><br>  \n<p> THY’nin 2022 yılında 2019 kapasitesinin %85’ine ulaşacağını öngörüyoruz. 2021'de hem hacimsel hem de fiyatlama anlamında kargo faaliyetlerinin THY'nin karlılığına oldukça olumlu katkısı oldu. Havayolları 2022 kapasitelerini arttırtıdıkça kargo kapasitesinin artması sonucu 2022'de kargo birim gelirlerinde (2019 seviyelerinin üzerinde kalsa da) yıllık bazda düşüş olmasını bekliyoruz. Kargo hacminde 2022’de %9 artış tahmin ederken, ton başına kargo birim gelirde %22 düşüş öngörüyoruz. 2022’de THY için 12.1 milyar dolar konsolide satış geliri ve 3.2 milyar dolar FAVKÖK (şirket hesaplaması) tahmin ediyoruz. Jet yakıt maliyetindeki artış ve kargo gelirlerinin payındaki gerileme sonucu 2022 FAVKÖK marjında yıllık bazda yüzde 4.7 düşüş tahmin ediyoruz.\n\n</p><br> \nTHY’i 6.5x Firma Değ./FAVÖK çarpanı ile değerliyoruz. 2022 – 2023 yıllarının ortalama düzeltilmiş FAVÖK rakamını kullanıyoruz. THYAO için 20.8 TL hedef fiyatımız ile AL tavsiyemizi koruyoruz. Aşılanma hızı, yeni ilaç ve tedavi yöntemleri ile vaka sayılarındaki gelişmeler yönelik  haberlerin önümüzdeki dönemde hisse performansında etkili olabileceğini düşünüyoruz. \n</p><br>  \n  <p><b>Riskler</b></p><br>  \n<p> Terör saldırıları gibi havayolu seyahat talebini olumsuz etileyecek dışsal gelişmeler, salgının beklenenden daha uzun sürmesi, beklentilerden daha düşük birim gelirler, petrol fiyatlarındaki artış ve yolcu trafiğinin beklentilerden daha düşük gerçekleşmesi hisse için önemli risklerdir.    P><br>\"",
      ACIKLAMA_ENG:
        "Investment Case\nThanks to its mostly f-x denominated revenues (87%) vs higher TL exposure on costs (26%) and fixed interests rate on f-x denominated debt are the main advantages of THY in current macro-economic conditions. Low share (30%) of domestic and outbound flights in total turnover provides a safe cushion to worsening consumer sentiment in Turkey due to economic turmoil. IGA (Istanbul Grand Airport) with higher pax and cargo capacity will support THY’s fleet growth to 475 in 2023 from 332 in 2018. \nCatalyst\nBeing one of the main beneficiaries of expected boom in tourist arrivals, we project THY’s total pax traffic to reach 77mn (THY:80mn) in 2019, up by 3% YoY, driven by int’l pax growth. THY budgets 6%-8% ASK growth, allocating to higher capacity to int’l routes. We project 2% increase in overall yield to USc7.4 in 2019. We penciled in 5% CASK increase in 2019 (THY: + 3%/5%) mainly due to increase in personnel expenses and higher airport fees resulting from move to IGA.  Increasing share of more profitable direct int’l pax rather than transfer pax and further decline in oil prices will be the major catalysts for the stock. \n\nKey Risks \nWe believe that external events such as terrorist attacks seriously hurting demand for air travel, worse than expected yields, higher oil prices and weaker than expected pax traffic are the major downside risks for the stock. THY Management denied its interest in IGA as well as in any other airport several times, mentioning that their current focus is on financing of new A/C deliveries. Any potential US sanctions may negatively affect airline’s operations, which is partially in stock’s price, in our view.",
