      ACIKLAMA_TR:
        '"<p><b>Yatırım Teması</b></p><br>  \n<p> Binek araç ve hafif ticari olarak dengeli ürün gamı, yüksek ihracat hacmi  (cironun yaklaşık %60’i ), Egea binek araç ailesinin olumlu etkilediği yüksek yurtiçi pazar payı  ve 450 bin araçlık kurulu üretim kapasitesi ile Tofaş Türkiye’nin önemli otomotiv üreticileri arasında yer almakta. Fiat Grubu ile uzun yıllardır devam ettirdiği maliyet + mark-up ihracat anlaşmaları şirketin ihracat faaliyet marjlarını hammadde fiyat artışlarına karşı koruma sağlarken, yine Fiat Grubu ile yapılan al veya öde ihracat anlaşmaları ihracat adetlerindeki talep düşüşlerinde şirket için koruma sağlıyor. Ayrıca yüksek ihracat gelirleri şirketi TL’deki dalgalanmalar karşı güvenli liman oluşturuyor. </p><br>  \n<p><b>Katalizör</b></p><br>  \n<p>Tofaş 2021 yılı için  132 bin adet yurtiçi satış hacim beklentimiz, önceki 120 bin ihracat hacim beklentimizi ile %31 FAVÖK ve %50 net kar büyümesi hesaplıyoruz. Fiat ve Peugot Gruplarının birleşmesi sonucu ortaya çıkan büyük Stelantis Grubundan gelebilecek projeler şirketin KKO\'nın arttıracağından operasyonları olumlu etkileyecektir. Elektrikli araç projleride bir diğer beklenti unsuru olarak öne çıkıyor . </p><br>  \n \n<p>   Global çip krizindeki tedarik sıkıntısının üretimde yarattığı yavaşlama bir yana, yeni nesil Doblo yatırımı ile FCA ve PSA birleşmesiyle çıkabilecek yeni proje beklentileri ile TOASO son iki aydır endeksin yaklaşık %40 üstünde getiri sağladı. TOASO için 62.90TL hedef fiyatımız cazip getiriye işaret etmediğinden TUT tavsiyemiz bulunuyor..  p><br>  \n<p><b>Riskler</b></p><br>  \n<p> Öncelikle Avrupa otomotiv pazarında olabilecek daralma ve Türkiye otomotiv talebini olumsuz etkileyecek kur ve faiz artışlarının şirketin faaliyetleri açısından önemli risk unsurları olduğunu düşünüyoruz.p><br>"',
