      ACIKLAMA_TR:
        "\"<p><b>Yatırım Teması</b></p><br> \n\n<p> Salt üretici konumunda olan Vestel Beyaz Eşya ürünlerinin satışını Vestel Elektronik’in tamamına sahip olduğu Vestel Pazarlama’ya yapmaktadır. Vestel Pazarlama’nın portföyüne yeni markalar ve yeni lisans anlaşmaları ekleyerek yüksek kar marjına sahip markalı ürün satışlarını arttırmaya odaklanan stratejisi Vestel Beyaz Eşya’yı da olumlu etkilemektedir.  Vestel Beyaz Esya'nın i) A markalı müşteri sipariş portföyünün genişletilmesiyle karlı büyüme sağlayan ihracata dayalı iş modeli, ii) Türkiye'deki rekabetçi üretim kapasitesinin sunduğu ölçek ve lojistik avantajları, ve iii) sürdürülebilir yüksek temettü getirisi potansiyeli sayesinde cazip bir yatırım teması sunduğuna inanıyoruz. Vestel Beyaz Eşya yakın zamanda kapasitenin yaklaşık %50 oranında arttırılması için adımlar atmaya başladı. Yeni kapasite ihtiyacı, i) A markalı müşterilerin üretim ihtiyaçlarını dış kaynaklardan temin etme eğilimlerindeki artış, ii) mevcut müşterilerin talep atışı, iii) beklenen yeni müşteri kazanımları ve iv) yeni pazarlara giriş planlarından kaynaklanmaktadır. Vestel Beyaz'ın düşük maliyetli üretim avantajları ve köklü küresel iş ağından yararlanarak ihracat hacmini önümüzdeki beş yılda %10 YBBO büyütmesini bekliyoruz. \n p><br> \n\n<p><b>Katalizör</b></p><br> \n\n<p> Vestel Beyaz 3Ç21’de, geçtiğimiz yılın yüksek baz teşkil etmes ve zayıflayan operasyonel performansı nedeniyle %23 net kar düşüşü açıkladı. Ekonomilerin yeniden açılması, aşılanmanın hızlanması ve tüketicilerin harcama alışkanlıklarında meydana gelen değişiklikler (eğlence ve seyahat harcamalarına daha çok bütçe ayrılması) ile beyaz eşya talebinde gözlemlenen normalleşmeye rağmen, maliyet bazlı fiyat artışları, pozitif kur etkisi ve ihracat hacimlerindeki artış sayesinde satış gelirleri yıllık bazda %55 büyüme kaydetti. FAVÖK 3Ç21'de yıllık bazda %19 düşerek 428mn TL olarak gerçekleşti. Bu düşüşte, artan maliyet baskıları, EUR/USD paritesindeki aşağı yönlü seyir ve görece düşük ciro büyümesi karşısında operasyonel kaldıraç etkisinin zayıflaması etkili oldu. Böylece FAVÖK marjı 3Ç20'deki %20,9 ve 2Ç21'deki %15,7’ye karşılık 3Ç21'de %10,9 seviyesinde gerçekleşti. \n\nYönetim, yılın son çeyreğinde devam eden yüksek baz etkisi nedeniyle yıllık yurt içi satış büyümesinin sınırlı kalmasını bekliyor. Öte yandan, Şirket, mevsimsel faktörlerin (Kara Cuma, Noel gibi) etkisiyle ihracat hacimlerinde artış öngörüyor. Ek olarak, üçüncü çeyrekte yapılan fiyat ayarlamalarının ihracat satışları üzerindeki tam etkisini yılın son çeyreğinde görmeyi bekliyorlar. Son olarak, marjların 3Ç21'e kıyasla düşüş göstermesi beklenen plastik maliyetleri, yeni maliyet düşürme projeleri ve EUR/USD paritesindeki yükseliş ile desteklenmesi bekleniyor. 2021’de Vestel Beyaz Eşya’nın yıllık %63 ciro artışı ve %13 FAVÖK artışı kaydedeceğini tahmin ediyoruz. %70 kar dağıtım oranı tahminimizle, Vestel Beyaz Eşya’nın 2021 karından 2022’de 1 milyar TL temettü dağıtacağını öngörüyoruz. Temettü tahminimiz yüksek bir temettü verimine işaret ediyor. </p><br> \n\n<p><b>Riskler</b></p><br> \n\n<p> Vestel Beyaz Eşya’nın en büyük dezavantajının düşük halka açıklık oranı dolayısıyla daha düşük işlem hacmi olduğunu düşünüyoruz. Öte yandan, şirketin salt üretici olması, Vestel Elektronik tarafından yürütülen satış pazarlama faaliyetlerinde kontrolü olmamasını bir risk unsuru olarak görüyoruz. Diğer risk faktörleri; i) Beklentimizden daha zayıf Türkiye ve Avrupa beyaz eşya pazarları, ii) kar marjlarını olumsuz etkileyecek hammadde fiyatlarındaki artış, iii) Avro’nun ABD Doları karşısında değer kaybetmesi, iv) özellikle Çinli üreticiler tarafından gelebilecek rekabet baskısı, v) Vestel Elektronik’in piyasada yüksek miktarlı hisse satışı gerçekleştirmesi halinde hisse fiyatı üzerinde oluşabilecek baskı olarak sıralanabilir p><br>\"",
