      ACIKLAMA_TR:
        "<p><b> Yatırım Teması </b></p><br>\n\n\n\n<p>2021 yılında kısıtlamaların kalkması ve ekonomilerin toparlanması ile küresel petrol talebi yıllık bazda %6 artış gösterdi. Brent petrol fiyatı yıl boyunca artan trendini korudu, Ekim ayında ise son üç yılın en yüksek seviyesine ulaştı. Bununla birlikte artan mobilite ve stoklardaki normalleşme ürün karlılıklarına olumlu yansıdı. Ürün karlılıklarında üçüncü çeyrekte gözlemlenen güçlü toparlanma dördüncü çeyrekte de artarak devam etti. Üçüncü çeyrekte ortalama 7,1 $/v olan motorin ürün karlılığı dördüncü çeyrekte 11,3 $/v seviyesine yükselirken Ocak ayında aylık bazda 1,2 $/v artarak 12 $/v’e yükseldi. Üçüncü çeyrekte 4,4 $/v olan jet yakıtı ürün karlılığı dördüncü çeyrekte 9,1 $/v’e, Ocak ayında 12,9 $/v’e yükseldi. Üçüncü çeyrekte 14,8 $/v olan benzin ürün karlılığı ise dördüncü çeyrekte 12,5 $/v seviyesine geriledi. 2022 yılında da ürün karlılıklarındaki güçlü görünümün devam etmesini bekliyoruz. Ağır-hafif petrol fiyat makası yılın ikinci yarısında açılmaya devam etti. 2021 yılında ortalama 2 $/v genişleyen Ural-Brent makasının, 2022 yılında da aynı seviyelerde kalarak Tüpraş’ın karlılığını olumlu etkilemeye devam etmesini bekliyoruz. 2022 Ocak itibariyle doğal gaz arz kesintileri ve fiyatlara yapılan artışlar, Tüpraş’ı alternatif yakıt arayışına yöneltti (Tüpraş’ın enerji maliyetlerinin yaklaşık %90’ını doğal gaz oluşturuyor, enerjinin toplam üretim maliyetindeki payı ise %3). Bununla birlikte Botaş tarafından doğal gaz kullanımına getirilen sınırlama ile birlikte Tüpraş’ın kapasite kullanım oranlarında yılın ilk çeyreğinde bir düşüş görebiliriz. </p><br>\n\n\n\n<p><b> Katalizör </b></p><br>\n\n\n\n<p> Artan talep ve mobiliteyle ürün karlılıklarının güçlenmesi ve ağır-hafif petrol makaslarının şirket lehine açılması hisse performansı için en önemli katalizörler olarak öne çıkıyor. l </p><br>\n\n\n\n<p><b> Riskler </b></p><br>\n\n\n\n<p> Değerlememize yönelik en önemli risk unsurlarını ise, küresel ekonominin zayıflamasına yönelik endişeler, pandemi sebebiyle meydana gelebilecek yeni kısıtlamalar, ağır-hafif petrol fiyat makaslarının daralma ve doğal gaz arz sıkıntılarının uzun süre devam etmesi olarak sayabiliriz.</p><br>",
      ACIKLAMA_ENG:
        '"<p><b>Investment Case</b></p><br>\n<p> Recovery in crack margins continues: With the increasing mobility and re-openings of economies, the improving trend in crack margins, especially middle distillate cracks, continues. Supply-related issues caused by hurricanes in the USA stand out as another factor that supports crack margins. Diesel crack, averaging at US$4.9/bbl in Q2, reached to US$7.1/bbl in Q3 and to US$9.5/bbl in September. Jet fuel crack, which was at US$2.3/bbl in average in Q2, increased to US$4.4/bbl in Q3 and to US$6.6/bbl in September. Gasoline crack, which was US$11/bbl in average in Q2, climbed to US$14.8/bbl in Q3. With the upward trends in middle distillate cracks, We expect refining margins continue to increase until the end of the year.\nDifferentials continue to widen in the second half of the year: Although differentials has not widened as much as our initial projections due to the conservative approach to production increases of OPEC+ countries, heavy-light crude oil price differentials widened by US$2/bbl in average on annual basis and improved slightly on a quarterly basis to US$3/bbl in Q3. We expect the differential to continue to widen in favor of Tüpraş in the last quarter of the year with the effect of production increases of OPEC+ countries. Furthermore, we forecast that the increase in Brent oil prices and depreciation of the Turkish Lira will continue to positively affect operational profitability via inventory gains in 2H21.\n</p><br>\n</p><br>\n<p><b>Catalyst</b></p><br>\n<p> Strengthening crack margins with increasing mobility and demand and widening heavy crude differentials in favor of the company are the most important catalysts for the share performance. .</p><br>\n<p><b>Key risks</b></p><br>\n<p> Concerns over the weakening of global economy, new restrictions that may occur due to the pandemic and lower than expected heavy-light crude differentials are the most prominent risk factors surrounding our valuation.p><br>"',
