      ANALIST: "Sinem Cango",
      ACIKLAMA_TR:
        '"<p><b>Yatırım Teması</b></p><br> <p>Akçansa’nın mevcut projelerinin büyük bir kısmının altyapı projelerinden oluşması ve 2021’de hayata geçmesi planlanan projelerin de çoğunlukla alt yapı projeleri olmasını iç talebin yüksek faiz ortamından olumsuz etkilenmeyeceğinin göstergesi olarak görüyoruz. Akçansa’nın dış pazardaki güçlü pozisyonunu devam ettirerek ihracat gelirleri ile karlılığını koruyacağını düşünüyoruz. Aynı zamanda, ihracat gelirlerinin güçlü seyrinin sürdürülmesiyle Şirket’in alacak günlerinde ve işletme sermayesi ihtiyacındaki düşüşün devam etmesini bekliyoruz. Diğer yandan, bakım ve onarım yatırımlarının yeniden devreye girmesinin yanı sıra maliyet tarafında iyileşme sağlayacak yatırım harcamalarının gerçekleştirilmesini bekliyoruz. Akçansa 2020 karından 2021’de 105 milyon TL temettü dağıttı. Şirket, geçtiğimiz senelerde temettü dağıtımı için nakit ihtiyacını borçlanma araçlarıyla karşılamıştı  </p><br>\n\n<p><b>Değerleme</b></p><br>\n\n<p> Makro tahminlerimizde ve beklentilerimizde yaptığımız değişiklikler sonrasında AKCNS için hisse başına hedef fiyatımızı önceki 15.18TL’den 20.63TL’ye yükseltiyoruz. Yeni hedef fiyatımız %14 artış potansiyeli sunmakta. Sınırlı artış potansiyeli nedeniyle TUT tavsiyemizi yineliyoruz. Hisse 2021T 7.2X FD/FAVÖK ve  11.5x F/K çarpanları ile işlem görüyor (tarihsel ortalamaları: 9.6x FD/FAVÖK vs 20.0x F/K).\n. </p><br>\n\n<p><b>Riskler</b></p><br>\n\n<p> Akçansa için; iç talepteki zayıflığın devam etmesi, dış pazardaki rekabetin artmasıyla ihracat gelirlerinin beklentimizin altında kalması, döviz bazlı enerji fiyatlarındaki artış ve zayıf TL şirketin operasyonel performansını olumsuz etkileyecek risk faktörleri. </p><br>"',
      ACIKLAMA_ENG:
        '"<p><b>Investment Case</b></p><br>\n<p> It can be seen that the majority of Akçansa’s current projects consist of infrastructure projects and that the projects planned to be implemented in 2021 are mostly infrastructure projects, as an indicator that domestic demand will not be adversely affected by the high interest rate environment. We believe that Akçansa will maintain its strong position in the foreign market and maintain its profitability with export revenues. At the same time, we expect the company\'s receivables days and working capital requirement to continue to decline with the continued strong course of export revenues. On the other hand, we expect maintenance and repair investments to be reactivated, as well as investment expenditures that will improve the cost side. Akçansa distributed 105 million TL dividend in 2021 from its 2020 profit. In recent years, the company met its cash needs for dividend distribution with debt instruments. p><br>\n\n<p><b>Catalyst</b></p><br>\n<p> After the revision we made in our macro estimates and expectations, we are increasing our target price per share for AKCNS from TL15.18 to TL20.63. Our new target price offers a 12% increase potential. We reiterate our HOLD recommendation due to limited growth potential. The stock is trading at 2021T 7.3x EV/EBITDA and 11.7x P/E multipliers (Historical averages: 9.6x EV/EBITDA vs 20.0x P/E).\n. </p><br>\n\n<p><b>Key risks</b></p><br>\n<p> The continuing weakness in domestic demand, export revenues remained below our expectations due to increased competition in the foreign market, and the increase in foreign currency-based energy prices are risk factors that will adversely affect share performance.\n. \n</p><br>"',
