      ACIKLAMA_TR:
        '"<p><b>Yatırım Teması</b></p><br>\n\n<p> Düşük baz etkisi ve normalleşme ile yılın ikinci çeyreğinde ilaç satışları kutu bazında iyileşme gösterdi. IMS’nin sunduğu verilere göre Türkiye’de 2021’in ilk yarısında ilaç satışları kutu bazında yıllık yaklaşık %3 düşüş gösterdi. Bu dönemde Selçuk Ecza, pazarda meydana gelen daralma ve Şirket’in pazar payı kaybına rağmen (kutu bazında pazar payı %42,35’ten %41.35’e geriledi), 19 Şubat tarihinde devreye giren %20 ilaç zammı sayesinde cirosunu yıllık bazda %13 arttırdı. İkinci çeyrekte ise Şirket ilaç satışlarında kutu bazında meydana gelen iyileşme, düşük baz etkisi ve ilaç fiyatlarına yapılan zam sayesinde %23 ciro büyümesi kaydetti. Yılın ilk yarısında FAVÖK yıllık bazda %55 artış göstererek 724 mn TL gerçekleşti. Bu büyüme, stok kazançlarının olumlu etkisi (ilaç zammı geçtiğimiz sene %12,1’di) ve artan operasyonel kaldıraç ile desteklendi. Böylece FAVÖK marjı yıllık bazda 1.7 puan artarak % 6,2\'ye yükseldi. Normalleşmenin hızlanması (okulların açılması, sosyal mesafenin azalması, maske kullanımının düşmesi) ile birlikte doktor ziyaretlerinin artması, düşük baz etkisi ve ürün kompozisyonunda meydana gelmesini beklediğimiz olumlu değişik ile yılın geri kalanında Şirket’in daha güçlü sonuçlar açıklamasını bekliyoruz. \n </p><br>\n\n\n\n<p><b>Katalizör</b></p><br>\n\n<p> TL’nin EUR karşısındaki değer kaybı 2022 yılı için güçlü ilaç fiyat artışına işaret ediyor. Beklentilerin üzerinde gelen güçlü 2Q21 sonuçları ardından 2021 yılı için ciro tahminimizde değişiklik yapmazken, FAVÖK büyümesi beklentimizi %45 olarak revize ediyoruz (önceki %34). Diğer yandan TL’nin EUR karşısındaki değer kaybı 2022 yılı güçlü ilaç fiyat artışına işaret ediyor. Geçmişte, özellikle TL’de değer kaybının yüksek olduğu yıllarda, ilaç fiyat artışlarına getirilen sınırlamalar düşünüldüğünde, 2022 yılında devreye girecek ilaç fiyat artışının 2021 yılına benzer seviyelerde olmasını bekliyoruz. Fiyat artışı ve kutu büyümelerinde meydana gelmesini beklediğimiz iyileşme ile birlikte Şirket’in 2022’de %28 ciro ve %26 FAVÖK büyümesi kaydetmesini bekliyoruz. \n</p><br>\n\n\n\n<p><b>Riskler</b></p><br>\n\n<p> i) İlaç  fiyat artışlarına uygulanacak ek ıskonto, ii) doktor ziyaretlerinin ertelenmesi nedeniyle kutu büyümelerinin zayıf seyretmeye devam etmesi, iii) sektörün kar marjlarını azaltacak regülasyon değişiklikleri, vi) SGK’nın eczanelere ödeme yaptığı vadeyi uzatması, v) beklentilerimizin üzerinde gerçekleşecek işletme sermayesi ihtiyacı ve EUR/TL kurunun veya ilaç zamlarının projeksiyon döneminde beklentilerimizin altında kalması hedef fiyatımız için temel risk faktörleri. Özellikle TL’de değer kaybının yüksek olduğu yıllarda, ilaç fiyat artışlarına sınırlama geldiği veya EUR kuruna uygulanan ıskontonun artırıldığının gözlemlendiğini hatırlatmak isteriz. Bu oranın yukarı çekilmesi büyüme tahminlerimiz üzerinde aşağı yönlü risk oluşturabilir.\n p><br>"',
      ACIKLAMA_ENG:
        "<p><b>Investment Case</b></p><br>\n<p> Selcuk Ecza is the largest pharmaceutical wholesaler in Turkey commanding a 41.84% market share in a duopolistic market, where first two players control more than 70% of the market. We have long term constructive view of Selcuk Ecza on 5% expected growth in Turkish pharmaceutical market (unit growth) with respect to favorable demography and increasing access to healthcare services. Market leader position of the company (with 42%), brought significant scale advantages in terms of greater negotiation power over suppliers, greater availability of products and flawless delivery logistics. We expect Selcuk to improve its free cash flow generation going forward on improving working capital structure and lower capex requirement, following completion of automation investments in major warehouses. Last but not least, Selcuk owns more than 100 warehouse, some of them are located in premium locations. Therefore, there is a hidden to value in the balance sheet, which might be unlocked in the future.p><br>\n\n<p><b>Catalyst</b></p><br>\n<p> We expect company to generate sifnificant inventory gains in the 1H18 on the back of annonced price increases of 15% with respect to revision fix EUR/TRY rate by 15% in February 15, 2017. </p><br>\n\n<p><b>Key risks</b></p><br>\n<p> Possible regulatory changes by the government on drug pricing and distributor’s profit margins and/or higer than expected increase in net working capital requirement are main risk factors for the company.</p><br>",
