      ANALIST: "Esra Şirinel",
      ACIKLAMA_TR:
        "\"<p><b>Yatırım Teması</b></p><br>\n\n<p>Şişecam’ın defansif iş modelini, döviz bazlı gelir akışını, düşük kaldıraçlı güçlü bilançosunu, uzun döviz pozisyonunu ve sürdürülebilir temettü dağıtım politikasını beğeniyoruz. Bunların yanı sıra, cazip değerlemesi ve 2Y23'te faaliyete geçecek olan Türkiye'deki ilave yeni düz cam kapasitesi, Macaristan'da 2024'te faaliyete geçecek cam ambalaj segmentindeki yeni yatırım ve ABD'de de 2026'da faaliyete geçmesi beklenen doğal soda külü yatırımıyla ivmelenecek büyüme hikayesi de hisseye yönelik olumlu görüşümüzün diğer nedenleri olarak öne çıkıyor. </p><br>\n\n\n\n<p><b>Katalizör</b></p><br>\n\n<p> Şişecam’ın konsolide satış gelirlerinde döviz bazlı gelirlerin payı %55 olmasına karşın konsolide SMM’deki döviz bazlı maliyetlerin payı %43 olduğu göz önüne bulundurulduğunda, TL’deki değer kaybının şirketin karlılığını olumlu etkilemesini bekliyoruz.  Şişecam Şubat 2020’de 150 milyon TL nominal hisseye kadar 1.2 milyar TL değerinde hisse geri alım programı açıkladığını hatırlatmak isteriz. Şirket bu zamana kadar 273 milyon TL değerinde 34.4 milyon hissesini geri aldı.\n\n.Talep izin verdiği sürece Şişecam’ın artan enerji maliyetlerini satış fiyatlarına yansıtabildiğini söyleyebiliriz.\n</p><br>\n\n\n\n<p><b>Riskler</b></p><br>\n\n<p>: i) ) Türkiye, Avrupa ve Rusya’da beklentimizden daha yavaş toparlanma ii) girdi maliyetlerinde beklentimizin üzerinde artışlar iii) Şişecam'ın SMM’de %11 paya sahip Türkiye doğal gaz fiyatında beklentimiz üzerinde artış iv) düz cam ve soda külü fiyatlarında kalıcı düşüş v) beklentimizden daha güçlü TL ve beklentimizden daha zayıf US$/Ruble kuru AL tavsiyemiz için önemli riskler olarak öne çıkmaktadır. \n. p><br>\"",
      ACIKLAMA_ENG:
        "<p><b>Investment Case</b></p><br>\n<p> Being present at every sub-segment of the glass industry, SISE offers exposure to the fast growing flat glass, recovering glass packaging, highly profitable defensive chemicals and very gradually  recovering glassware divisions. Sisecam generates 58% of its revenues from international operations (including exports from Turkey) in 13 countries which provides risk diversification and defensive characteristic as well as hard currency based revenues. p><br>\n\n<p><b>Catalyst</b></p><br>\n<p>. Prospective IPO of Pasanabce and possible sales of lands in Cayirova and Beykoz with a total book value of TL600m could bring greater upside for Sisecam.</p><br>\n\n<p><b>Key risks</b></p><br>\n<p> Upside risks for the company are i) Acquisitions & capacity additions ii) Better than anticipated margin delivery and iii) prospective Pasabahce IPO. Downside risks are i) the downturn in macro environment leading to a contraction in construction sector, ii) higher than expected natural gas price hike. </p><br>",
