      ACIKLAMA_TR:
        '"p><b> Yatırım Teması </b></p><br> \n<p> Şirket yönetimi 2021 beklentilerini tekrar yukarı revize etti. Türk Telekom, güçlü 2Ç21 performansı sonrası 2021 FAVÖK beklentisini 15.4 milyar TL seviyesinden 15.8 milyar TL seviyesine, gelir büyümesi beklentisini %16’den %17’ye ve yatırım harcaması beklentisini 8.0 milyar TL’den 8.5 milyar TL’ye yükseltti. FAVÖK\'teki değişim Şirket’in daha yüksek gelir büyümesi beklentisinden (özellikle mobil segmentte) ve faaliyet giderlerindeki ılımlı görünümden kaynaklanırken, yatırım harcaması beklentisindeki artış, iletişim hizmetlerine ve teknoloji servislerine olan yüksek talep ve kur etkisinden kaynaklandı. 2021 FAVÖK beklentisi yıllık bazda %19.4 yıllık büyümeye işaret ediyor. Mevcut 2021 ciro büyümesi beklentimiz %18, FAVÖK beklentimiz 15,9 milyar TL ve yatırım harcamaları beklentimiz ise 8,6 milyar TL seviyesinde. Türk Telekom, son bir yılda 1,6 milyon net abone kazanımıyla 13.8 milyon toplam genişbant abone sayısına ulaştı (+%13). Ek olarak, üst paketlere geçiş, toplam satışlar içinde fiberin artan payı ve sene başında yapılan fiyat düzenlemeleri ile abone başına gelir artışı da yıllık bazda %14 oldu. Yeni müşteri kazanımının 12-24 aylık kontratlar ile sağlandığı düşünüldüğünde, abone kazanımlarının ve ARPU artışının kalıcı olacağını düşünüyoruz. Diğer yandan, geçen yılın ikinci yarısında devreye giren yüksek baz ve talebin normalleşmesi ile abone artış hızında hafif bir yavaşlama öngörüyoruz.\n\nMobil tarafta fiyat artışları ve günlük hayatın normale dönmesi ile ivmelenme. Şirket’in mobil abone bazı yılın ilk yarısında toplam 537 bin net abone artışı ile 23.4 milyona ulaştı (+%2). Faturalı bazındaki 1 mn net abone kazanımı, ön ödemeli taraftaki düşüşün önüne geçti. Pandemi koşulları etkisiyle yılın ilk yarısında zayıf performans gösteren mobil segmentinin Temmuz ayından itibaren günlük hayatın büyük ölçüde normale dönmesi, uluslararası uçuşlardaki ve turizm aktivitesindeki artış ile yılın ikinci yarısında daha güçlü bir katkı sağlamasını bekliyoruz. Ek olarak, Haziran ayında yapılan fiyat ayarlamaları, rekabetçi ortamın nispeten rasyonelleşmesi, değişen abone karması ve premium paketlere geçiş ile ARPU büyümesinin desteklenmeye devam edileceğini öngörüyoruz.\n </p><br> \n<p><b> Katalizör </b></p><br> \n<p> Bilançodaki kısa vadeli kur riski temizlendi ve bunun sürdürülmesi öngörülüyor. Şirket, 4Q20’den itibaren hedge işlemlerini arttırarak 38mn dolar döviz uzun pozisyona geçti (2Ç20: 706 mn USD açık döviz pozisyonu). Şirket geçtiğimiz yıllarda döviz pozisyonunu kademeli olarak azaltsa da TL’deki yüksek oynaklık net kar üzerinde etki yapmaya devam etmişti. İleriye yönelik olarak şirket açık pozisyon taşımayan bilanço yapısını sürdürmeyi hedefliyor. Bu sayede, net kar öngörülebilirliğinin ve temettü potansiyelinin artacağını düşünüyoruz. %50 kar dağıtım oranı tahminimizle, şirketin 2021 yılı temettü ödemesi yüksek bir getiriye işaret ediyor </p><br> \n<p><b> Riskler </b></p><br> \n<p> Değerlememizin ana riskleri arasında fiyat artışın beklentilerin altında kalması, mobil taraftaki irrasyonel rekabet, 5G ve lisans yenileme nedeni ile yüksek nakit çıkışları ve TL’nin beklentilerimizin üzerinde değer kaybetmesi bulunuyor.  </p><br>"',
      ACIKLAMA_ENG:
        "<p><b>Investment Case</b></p><br>\n<p> Turk Telekom transformed itself as a ¨customer-oriented¨ integrated structure by unifying its mobile, fixed voice, broadband and TV products and services under the single ¨Turk Telekom¨ brand with a diversified product portfolio. It is the incumbent and wholesale provider in fixed voice and fixed broadband market while the biggest player in retail broadband market with a market share of 65% and the third player in mobile market in terms of number of subscribers.</p><br>\n<p><b>Catalyst</b></p><br>\n<p>The company has increased focus on untapped households by new entry-level wholesale campaign, ¨İnternet Bizden¨. The company aims for higher penetration via this campaign targeting customers with an existing fixed connection. In addition, customers are looking for higher capacity and speed which affect the top-line positively. Fiber investments will stimulate the growth at this segment.</p><br>\n<p>Adoption of IFRS 15 and IFRS 9 accounting standards is expected to have around TL600mn incremental impact on 2018 EBITDA and CAPEX. Its consolidated EBITDA is expected to be in the range of TL7.6bn and TL7.8bn while revenues is expected to increase by 11% YoY. .</p><br>\n\n<p><b>Valuation</b></p><br>\n<p> We value Turk Telekom using a combination of DCF and peer comparison analysis. p><br>\n<p> Our EBITDA expectation stands at TL7.8bn with an EBITDA margin of 39% in 2018. p><br>\n<p><b>Key risks</b></p><br>\n<p> Major risks can be counted as (i) regulatory risks, (ii) highly vulnerable to TL weakness, and (iii) concession period ends in 2026. p><br>",
