        '"p><b> Yatırım Teması </b></p><br> \n<p> Yataş’ın, tüketicinin beğenisine uygun kanıtlanmış ürün portföyü, iii) uluslararası pazarda artan etkinliği, iii) Türkiye’deki olumlu demografik dinamikler (küçülen hane halkı sayısı ve kısalan mobilya yenileme süresi) ve iv) gelenekselden modern kanala kayan mobilya talebi nedenleriyle iyi bir büyüme hikâyesi sunduğunu düşünüyoruz. YATAS için 19.4 TL hedef fiyat ile AL tavsiyemizi koruyoruz. \n </p><br> \n<p><b> Katalizör </b></p><br> \n<p> Diğer yandan, yüksek baz etkisi ve maliyet artışlarının negatif etkisi marjlar üzerinde baskı kurmaya başlıyor. Divanev mağazalarının artan katkısı ve TL’deki değer kaybı ile birlikte artan ihracat gelirlerinin yılın geri kalanında satış büyümesini desteklemesini bekliyoruz. Diğer yandan geçtiğimiz yılın 2. yarısında oluşan güçlü talep koşullarının ve yapılan fiyat artışlarının yılın geri kalanı için yüksek bir baz oluşturmakta. Bu beklentiler doğrultusunda Yataş’ın 2021 yılında %46 ciro büyümesi kaydetmesini bekliyoruz. Diğer yandan, yüksek baz ve bazı ham maddelerin arz sıkıntısı nedeni ile maliyetlerinin artması sonucu FAVÖK marjının geçen seneye kıyasla 3 puan gerileyerek %15.4 olarak gerçekleşmesini bekliyoruz. TL’nin son zamanlardaki değer kaybı nedeniyle maliyet baskısının yılın dördüncü çeyreğinde daha belirgin bir şekilde hissedileceğini öngörüyoruz. 2022 yılında ise Şirket’in mağaza açılışlarına devam ederek %36/%41 ciro/FAVÖK kaydetmesini bekliyoruz. \n </p><br> \n<p><b> Riskler </b></p><br> \n<p i) Hammadde fiyatlarının beklentilerin üzerinde artış göstermesi, ii) Arz sıkıntısı ve kur kaynaklı ham madde maliyet artışlarının rekabet ortamı nedeni ile fiyatlara yansıtılamaması. iii) Mağaza açılışlarının yavaşlaması. </p><br>"',
      ACIKLAMA_ENG:
        "<p><b>Investment Case</b></p><br>\n<p> Yatas Yatak is the market leader at bedding and third largest player at Turkish furniture industry, with ambitious growth plans both in domestic and international markets. Main investment positives are : i) large growth potential through new store openings both in domestic and international markets, ii) potential operational improvement with the benefits of the restructuring at brand positioning, iii) positive impact of increased taxes on furniture imports to Turkey, iv) cheap multiples compared to its peers. p><br>\n\n<p><b>Catalyst</b></p><br>\n<p> We expect company to maintain its growth momentum (+30% y-y top-line) in 2018 as well with flat EBITDA margin. </p><br>\n\n<p><b>Key risks</b></p><br>\n<p> Slower than estimated store openings, sharp downturn in domestic demand and low barriers to entry to the sector are the major risks to our call. </p><br>",
