        "p><b> Yatırım Teması </b></p><br> \n<p> Yatırım temamızın öne çıkan unsurları i) şirketin karlılığı yüksek ve hızlı büyüyen uluslararası operasyonlarının artan katkısı, ii) Türkiye pazarındaki güçlü konumu, iii) kur riski barındırmayan sağlıklı bilançosu ve iv) önümüzdeki iki yılda normalleşmesini beklediğimiz işletme sermayesi ve güçlü FAVÖK büyümesi ile artan nakit yaratımı. \n</p><br> \n<p><b> Katalizör </b></p><br> \n<p> 2020 yılında, Ülker’in operasyonel nakit akışının, i) devam eden sağlıklı FAVÖK büyümesi ve ii) işletme sermayesinde beklediğimiz normalleşme nedeni ile oldukça güçlü seyretmesini bekliyoruz. Buna ek olarak, şirketin Godiva Belgium’dan 120mn dolar temettü geliri elde etmesini beliyoruz. Güçlü nakit akışı ve temettü gelirinin, Ülker’in net borç/FAVÖK oranını 0.4x seviyesine düşüreceğini öngörüyoruz.  </p><br> \n<p><b> Riskler </b></p><br> \n<p> Net işletme sermayesinde bu seviyelerin üzerinde bozulma ve dolayısıyla beklentilerimizin altında gerçekleşecek operasyonel nakit akımı, ii) Ülker’in uluslararası operasyonlarının yoğunlaştığı Orta Doğu , özellikle Sudi Arabistan'da ortaya çıkabilecek jeopolitik riskler, iii) kakao ve palm yağın, buğday ve şeker fiyatlarında ani yükseliş ve Ülker’in rakiplerinin daha agresif fiyatlama stratejileri öne çıkan temel risk faktörleri.  </b></p><br>",
