      ACIKLAMA_TR:
        '"<p><b>Yatırım Teması</b></p><br> <p> 2021 yılı içinde iç talebin kuvvetli olmasının yanı sıra ihracat kanallarının da genişlemesini bekliyoruz. Diğer taraftan, Oyak Çimento, potansiyel büyüme ve teknoloji projeleri için oluşabilecek nakit ihtiyacı nedeniyle 2020 karından 2021 yılı içerisinde temettü dağıtmayacağını açıklamıştı. Bu büyüme projelerini detaylandırmak gerekirse, Şirket en büyük maliyet kalemlerinden birisi olan yakıt tüketimi pozitif yakıt kaynaklarına geçerek iyileştirmeyi düşünüyor. Ayrıca hatırlatmak gerekirse Şirket, Oyak Beton ile birleşmişti ve ürün kapasitesini geliştirmeye yönelik yeni bir beton tesisi yapılandırması da planlanmakta. Bunlara ek olarak, ürün çeşitliliğini arttırmak amacıyla çimento ve klinkerin yanı sıra yan ürünlere de yönelmeyi planlamakla beraber Oyak’ın en önemli oyunculardan birisi olduğu beyaz çimento pazarına yönelik üretim, dağıtım ve pazarlama kanallarını geliştirme planları da mevcut. Teknolojik yatırımların temelinde ise yapay zeka ve endüstri 4.0 desteğiyle planlama ve optimizasyon iyileşmeleri bulunmakta.\n. </p><br> \n<p><b>Değerleme</b></p><br> \n<p> Güçlü finansal sonuçlar sonrası beklentilerimizde meydana gelen değişiklikler ve makro tahminlerimizdeki güncellemeler ile OYAKC için hisse başına hedef fiyatımızı önceki 4.47TL’den 8.25TL’e yükseltiyoruz. Hedef fiyatımız %15’lik yukarı yönlü potansiyele işaret ediyor. Hisse için SAT tavsiyemizi sınırlı artış potansiyelinden dolayı TUT olarak değiştiriyoruz. Hisse 2021 tahminlerimize göre 15.5x FD/FAVÖK ve 14.4x F/K çarpanları ile yurt içi benzerlerine paralel seviyede işlem görüyor. \n.</p><br> \n<p><b>Riskler</b></p><br> \n<p> İç talep koşullarında beklenilenden hızlı bir toparlanma, döviz bazlı enerji maliyetlerinde anlamlı bir düşüş meydana gelmesi hedef fiyatımız üzerindeki ana risk unsurlarıdır. </p><br>"',
