      ANALIST: "Mizgin Akın",
      ACIKLAMA_TR:
        '"<p><b>Yatırım Teması</b></p><br>\n\n<p> Pandemi önlemlerinin kaldırılması ile güçlenen benzer mağaza büyümeleri, yüksek baza rağmen online satış kanalının hızlı büyümeye devam etmesi ve uluslararası operasyonların kur çevrim farkları sayesinde büyüme ve karlılıktaki güçlü seyrin yılın ikinci yarısında da devam edeceğini öngörüyoruz. Hatırlatmak gerekirse pandemiye ilişkin belirsizliğin azalması ile 2. çeyrek finansal sonuçlarının ardından Şirket yönetimi ilk kez 2021 yılına ilişkin öngörülerini paylaşmıştı. Buna göre yönetim 2021 yılında %70-75 ciro büyümesi ve %14-14,5 IFRS 16 etkisi hariç FAVÖK marjı (UFRS 16 etkisi sonrası: %20-20,5) öngörüyor.  </p><br>\n\n\n\n<p><b>Katalizör</b></p><br>\n\n<p>Yılın ikinci yarısında maliyet tarafında baskı ve daha güçlü baz etkisi olmasına rağmen, yönetimin 2021 büyüme ve karlılık öngörülerinin üst bandının ulaşılabilir olduğunu düşünüyoruz. Şirket’in girdi maliyetlerindeki baskıyı fiyat artışları, ürün yönetimi ve giderlerdeki disiplin sayesinde telafi edeceğini ve güçlü büyüme ile iyileşen operasyonel kaldıraç sayesinde FAVÖK marjının 2020 yılına göre yaklaşık 570 baz puan (UFRS 16 öncesi) iyileşerek %14,5’e ulaşacağını tahmin ediyoruz. 2021 yılı beklentimiz aynı zamanda pandemi öncesine göre de (2019 yılına göre) yaklaşık 50 baz puanlık marj iyileşmesine işaret ediyor.     </p><br>\n\n\n\n<p><b>Riskler</b></p><br>\n\n<p> Perakende sektörü, tüketici güveni, büyüme ve işsizlik gibi makro ekonomik parametrelerdeki değişimlere oldukça hassas. Dolayısı ile makro parametrelerde görülecek kötüleşme şirket için önemli risk faktörü. Döviz bazlı kira giderleri kar marjları için risk oluşturabilir. p><br>"',
      ACIKLAMA_ENG:
        '"<p><b>Investment Case</b></p><br>\n<p> One of the main beneficiary of the removal of restrictions and re-openings of economies: We estimate a strong topline growth in the remainder of the year driven by stronger traffic in stores with the re-openings of shopping malls, back-to-school season this year in Turkey and robust e-commerce growth despite very strong base. On profitability front, we anticipate that the company will compensate increasing cost pressures with pricing, product management, cost discipline and improved operational leverage.\nThe management revealed its guidance for the full year following 2Q results with the improving visibility regarding the pandemic. Accordingly, the management expects 70-75% revenue growth (1H21: +99% y/y), 5 net new store openings (9 store expansion), and a net cash position.  p><br>\n\n<p><b>Catalyst</b></p><br>\n<p> Despite the pressure on the cost side and stronger base effect in the second half of the year, we think that the upper band of the Management\'s 2021 growth and profitability guidance are quite achivable. We expect 75% topline growth in TL terms along with c.570bps EBITDA margin improvement on annual basis reaching to 14.5% (before IFRS 16) in 2021, thanks to strong growth and improving operational leverage. Our estimate also suggest c.50 bps improvement compared to 2019, a pre pandemic year.</p><br>\n\n<p><b>Key risks</b></p><br>\n<p>The major risks to our call are: i) weaker macro backdrop and consumer sentiment could hamper top-line sales and ii) high inflationary environment, increasing raw material prices and depreciation of TL may increase its cost base and may not be passed to the customers due to the competitive environment and deteriorating purchasing power, taking its toll on margins. </p><br>"',
