      ACIKLAMA_TR:
        '"<p><b>Yatırım Teması</b></p><br> <p> Taahhüt tarafındaki olumsuz görünüme rağmen Şirket’in sağlıklı bilançosu, döviz bazlı gelirleri ve stabil tarımsal-sanayi operasyonları nedeniyle değerlemesinin ucuz olduğunu düşünüyoruz. Hisse performansı için, büyük ölçekli yeni proje kazanımları ve zarar edilen projelerden alınabilecek potansiyel ek ödemelerin pozitif katalizör etkisi yaratacağını düşünüyoruz. Oluşan ek maliyetlerin karşılanması için işverenler ile görüşmeler sürüyor. Bu konuda 2021’de olumlu sonuçlar alınabileceğini düşünüyoruz. Salgının olumsuz etkilerinin azalması ve küresel ekonomideki toparlanma ile birlikte, 2022’de yeni proje edinimi konusunda iyileşme yaşanabileceğini düşünüyoruz.\n </p><br>\n<p><b>Katalizör</b></p><br>\n<p>Geçtiğimiz yıl, pandeminin etkisiyle, özellikle petrol zengini coğrafyalarda ekonominin zayıflaması sonucu altyapı ve sanayii yatırımlarındaki yavaşlama ve planlanan ihalelerde meydana gelen iptal veya ertelemeler, son yıllarda rekabetçi olmakta zorlanan Tekfen’nin portföyüne yeni projeler eklemesini zorlaştırdı. Salgının olumsuz etkilerinin azalması, küresel ekonomideki toparlanma ve petrol fiyatlarındaki artış ile birlikte, 2022’de yeni proje edinimi konusunda iyileşme yaşanabileceğini düşünüyoruz. 2Ç21 itibariyle Tekfen’nin bakiye sipariş büyüklüğü 1,50 milyar dolar seviyesinde. Tekfen’in yılın geri kalanında portföyüne 200 milyon dolar büyüklüğünde yeni proje ekleyebileceğini düşünüyoruz. Bu da 2021 yıl sonunda bakiye sipariş büyüklüğünün 1 milyar doların altına ineceğine işaret ediyor (ciro karşılama oranını 0.6x olarak hesaplıyoruz). Hatırlanacak olursa, Tekfen 2020’de inşaat segmentinde taahhüt projelerinde meydana gelen ek maliyet ve zararlar nedeniyle negatif FAVÖK kaydetmişti. 1Y21’de ise salgın nedeniyle ara verilen projelerde çalışmaların tekrar başlaması ve projelerden kaydedilmesi beklenen potansiyel zararlara karşılık herhangi bir karşılık ayırma ihtiyacı duyulmaması nedeniyle inşaat segmenti FAVÖK marjı, yönetimin 2021 yılı beklentisi %3.2’ye paralel %3.9 seviyesinde gerçekleşti. Biz 2021 yılında inşaat segmentinin Rusya ve Sudi Arabistan’da yer alan projelerden son çeyrekte zarar kaydedilme ihtimaline karşılık  %2 oranında bir  FAVÖK marjı tahmin ediyoruz.\n\nGübre fiyatlarında meydana gelen sert yükseliş sayesinde gübre segmenti 2021 yılına oldukça güçlü bir başlangıç yaptı. Diğer yandan, amonyak fiyatlarında meydana gelen artış ile birlikte üçüncü çeyrekten itibaren marjlarda bir normalleşme öngörüyoruz. 2022 yılının ise yüksek baz etkisi ve talep koşullarındaki zayıflama nedeniyle daha zayıf bir yıl olmasını bekliyoruz. \n </p><br>\n<p><b>Riskler</b></p><br>\n<p> i)Taahhüt segmentinde yeni proje edinimlerinin zayıf devam etmesi veya bakiye sipariş büyüklüğünü arttırmak amacıyla düşük marjlı projelere yönelinmesi, ii) Şirketin, 2020 beklentilerinin piyasa beklentilerinin altında kalması, iii) devam eden projelerde gecikme ya da tek seferlik zararların oluşması, iv) Tekfen’in ağırlıklı olarak faaliyet gösterdiği petrol zengini ülkelerde yaşanabilecek siyasi huzursuzluk, petrol fiyatlarında meydana gelebilecek sert düşüşler, v) gübre tarafında ise hammadde ve ürün fiyatı dinamiklerinin bozulması en önemli negatif risk unsuru olarak öne çıkmaktadır. </p><br>"',
