      ACIKLAMA_TR:
        "\"<p><b> Yatırım Teması </b></p><br>\n\n<p> 2021 beklentileri üzerinde yukarı yönlü risk olduğunu düşünüyoruz: Turkcell 2Ç21 sonuçları sonrasında 2021 beklentilerini tekrar revize etti. Turkcell, gelir artışı hedefini %14-16'dan %18'e, FAVÖK tahminini 14 milyar TL'den 14,3 milyar TL'ye ve operasyonel yatırım harcamaları/satışlar beklentisini (lisans ücretleri hariç) %20'den %21-22'ye revize etti. Gelir ve FAVÖK beklentisindeki yukarı yönlü revizyonun arkasındaki neden 1Y21dekii güçlü gerçekleşmeler ve abone bazında sağlıklı büyüme iken, yatırım harcamaları beklentisi i) TL'deki değer kaybı, ii) artan fiber bağlantı talebi (Turkcell sene başındaki 500 bin fiber bağlantısını 600 bine yükseltti), iii) umut verici bir pazar olan Ukrayna'da yatırımların arttırılmak istenmesi ve iv) artan veri kullanımına cevap verebilmek için daha yüksek yatırım harcaması gereksinimi nedenleri ile yukarı revize edildi. Fiber yatırımlarına ayrılan yüksek bütçe, Şirketin yaklaşmakta olan 5G geçişine hazırlıklı olma istekleri ile de ilişkilendirilebilir. 2021 yılında Covid-19 dönemindeki maliyet tasarruflarının normalleşmesiyle FAVÖK marjında 0.3 puan daralma öngörüyoruz. Diğer yandan, yaz aylarında yapılan fiyat artışları ve TL’deki değer kaybının desteklediği yurtdışı gelirleri nedeniyle Şirketin gelir büyümesi üzerinde yukarı yönlü risk görüyoruz. TL’deki değer kaybının Şirket’in yatırım harcamaları beklentisi üzerinde de yukarı yönlü risk oluşturabileceğini düşünüyoruz. Şirket’in mevcut beklenti 3 yıllık hedeflerinin (%16-%18) üzerinde seyrediyor. \n\nTurkcell’in içinde değer yaratabilecek birçok varlık mevcut: Turkcell bünyesinde, Super Online, Global Tower, Financell, Paycell gibi değerli birçok şirket mevcut. Bu şirketlerin halka arz veya stratejik ortaklık kapsamında değerlendirilmesinin, Turkcell’de önemli değer artışı yaratabileceğini düşünüyoruz. Anladığımız kadarıyla şirketin önceliği ilk olarak Superonline tarafında olası alternatifleri değerlendirmek.   </p><br>\n\n<p><b> Katalizör </b></p><br>\n\n<p> Yeni hissedar yapılanmasında en büyük ikinci ortak olan IMTIS Holdings’in (Rus Alfa), 19,8'lik hisseleri 22 Ekim 2021’den sonra satışa konu edilebilecek: Hatırlanacağı üzere IMTIS Holding, 110 milyon adet Turkcell hissesinin (ödenmiş sermayenin %5'i) hızlandırılmış talep toplamaya yöntemiyle, 10.11.2020 tarihinde, 15,25 TL’den satışını gerçekleştirmişti. Geriye kalan %19,8lik pay’ın ise Turkcell’de yeni hissedar yapısının kurulduğu anlaşma tarihinden itibaren 1 yıl satışa konu edememesi üzerinde mutabık kalınmıştı. Sürenin sona ermesi hisse üzerinde baskı oluşturabilir. \n  </p><br>\n\n \n<p><b> Riskler </b></p><br>\n\n<p> Değerlememizin ana riskleri arasında operatörler arası fiyat rekabetinin kızışması, 5G ve lisans yenileme nedeni ile yüksek nakit çıkışları ve beklentilerimizin altında gerçekleşecek  ekonomik büyüme ön plana çıkıyor. </p><br>\"",
      ACIKLAMA_ENG:
        "<p><b>Investment Case</b></p><br>\n<p> As Turkey’s leading digital operator, Turkcell expands its portfolio that enriches its customers’ 1440 daily minutes. Its digital services and solutions consume a larger part in its customer’s lives than the mere 31 minute phone call initiated by an average phone user. </p><br>\n<p><b>Catalyst</b></p><br>\n<p> Rising data and digital services usage as well as increased multiplay subscribers on both mobile and fixed side are the main triggers behind the strong revenue growth. p><br>\n<p>The company targets to have a revenue growth of 14-16% with an EBITDA margin 37-40% in 2018.  p><br>\n<p>It has a stable dividend distribution. It has decided to distribute total dividends of TL1.9bn from 2017 earnings. Including this, the company has distributed 60% of its new income since 2010.  p><br>\n\n<p><b>Valuation</b></p><br>\n<p> We value the company based on a combination of DCF and peer comparison analysis. Oue 2018 revenue estimate signals a growth of 14% with an EBITDA of TL7.8bn and EBITDA margin of 38.8%. p><br>\n<p><b>Key risks</b></p><br>\n<p>Increase in SCT for data might be on the government’s agenda in the future and deterioration at macro environment can be counted as major risks for the company. p><br>",
