        "<p><b>Yatırım Teması</b></p><br> <p> Mart ayından itibaren devreye giren düşük baz etkisi ve pandemi koşullarının hafiflemesi ile birlikte hastanelerin hasta trafiğinde iyileşme görülmeye başlandı (yılın ilk yarısında ayakta hasta ziyaretleri yıllık %14, yataklı hasta protokolleri ise yıllık %7 artış gösterdi)  Ek olarak, bu süreçte yapılan SUT fiyat artışları (Mart 2020 ve Nisan 2021) ve kompleks tedavilerin büyükşehirlere ve özel hastanelere kayması neticesinde gelir kompozisyonunda meydana gelen iyileşme sayesinde Şirket’in yurt içi hasta gelirleri yıllık %50 artış gösterdi. Medikal turizm gelirleri ise TL'deki değer kaybı ve 2Ç21’in düşük baz etkisi sayesinde yıllık bazda %87 artış kaydetti. Öte yandan, Şirket’in ana faaliyete odaklanma stratejisi doğrultusunda laboratuvar ihalesinin gönüllü olarak yenilememesi nedeniyle ise diğer gelirler 1H21'de yıllık bazda %48 düşüş gösterdi. Gelir büyümesine ek olarak sıkı maliyet yönetimi sayesinde FAVÖK 1H21’de yıllık %49 büyüdü. \n<p><b>Katalizör</b></p><br>\n\n<p> Aşılama faaliyetleri ile normalleşmenin hız kazanması, ertelenen talep, SUT fiyat artışları ve TL’deki değer kaybı nedeniyle medikal turizm gelirlerindeki iyileşmenin hızlanması ile birlikte 2021 için yıllık %35, 2022 için ise %20 ciro büyümesi tahmin ediyoruz. Karlılık tarafında ise i) devam eden maliyet kontrolleri, ii) son iki yılda Şirket’in görece yüksek karlılık sunan işlere odaklanma stratejisi doğrultusunda hastane portföyünü ve operasyonlarını optimize etmesi ve iii) yeni devralınan hastanelerin karlılığının arttırılması sayesinde Şirket’in operasyonel karlılığını korumaya devam edeceğini düşünüyoruz. Bu beklentiler doğrultusunda, MLP Care’in 2021’de %22.5 ve 2022’de %22.6 FAVÖK marjı kaydetmesini bekliyoruz. \nŞirket, 2022-2024 yılları için 46,5 milyon EUR tutarındaki sendikasyon kredisine ilişkin tüm borç servisini TL'ye çevirmesi sonucu 1Ç21 sonu itibari ile 6,2 milyon EUR döviz uzun pozisyona geçmiştir. İlerleyen dönemlerde Şirket’in güçlü operasyonel performans ve düşük yatırım harcaması borç azaltmaya odaklanmaya devam etmesini bekliyoruz. Şirket’in Net Borç / FAVÖK oranının 2020 yılsonundaki 2,0x seviyesinden 2023 yılsonunda 1x’in altına gerileyeceğini tahmin ediyoruz. Bu nedenle, Şirket’in net kar büyümesi ve temettü ödeme potansiyelinin artacağına inanıyoruz.\n </p><br>\n\n<p><b>Riskler</b></p><br>\n\n<p> Vaka sayılarının artması sonucu günlük hayatın kısıtlanması ve hastane ziyaretlerinde azalma meydana gelmesi ve sağlık turizmi gelirlerindeki iyileşmenin beklenenden uzun sürmesi, yeni devralınan hastanelerin beklenen performansı gösterememesi Şirket’in karlılığı ve açık pozisyonu üzerindeki en önemli risk unsurları. \n </p><br>",
      ACIKLAMA_ENG:
        "<p><b>Investment Case</b></p><br>\n<p>Main investment positives are: i) expansion in bed capacity, higher inpatient and outpatient volume, increased occupancy thanks to new hospital openings and through the developing and maturing hospital portfolio, ii) promising outlook for medical tourism, iii) higher contribution from ancillary business, iv) favourable economic and demographic factors in Turkey supporting future revenue growth, such as rising private healthcare spending, and an increase in the number of senior citizens, v) improvement in company’s profitability and decline in leverage going forward.</p><br>\n<p><b>Valuation</b></p><br>\n<p> We value MPARK using a combination of DCF and peer comparison analysis, applying equal weights to their outcomes. We forecast a higher top-line and EBITDA thanks to added contributions from developing hospitals and higher inpatient/outpatient volumes and occupancy in mature hospitals, </p><br>\n<p><b>Key risks</b></p><br>\n<p> Main risks: i) change in macroeconomic and competitive conditions could put pressure on MLP’s growth and profitability targets, ii) longer gestations of developing and new hospitals could have a negative impact on future earnings, iii) competition from city hospitals. </p><br>",
