      ACIKLAMA_TR:
        "<p><b>Yatırım Teması</b></p><br> <p> Garanti Bankasının kuvvetli vadesiz mevduat tabanı, güçlü mevduat fonlaması ve alternatif fonlamaları etkin kullanımı, net faiz marjı bakımından bankayı rakiplerinin önünde konumlandırıyor. Bu ayrıca aktif tarafında perakende kredilerdeki güçlü konum ile birleşince kuvvetli bir faaliyet karlılığını ortaya çıkarıyor. Ayrıca getirili aktifler ile faize hassas fonlama durasyon aralığının düşük oluşu faiz volatilitesinin olumsuz etkisini banka açısından azaltıyor.</p><br> <p> Sermaye yeterlilik oranlarının rakiplere daha güçlü oluşu ile muhafazakâr karşılık ayırma politikası bankanın olumsuz koşullara da hazır olduğunu gösteriyor.  Geçtiğimiz iki yıl boyunca ayrılan TL 2.3 milyar seviyesindeki serbest karşılıkların bu koruma kalkanını daha da güçlendirdiğini düşünüyoruz. Banka çeşitlendirilmiş gelir yapısıyla, düşük kaldıraca ve yüksek karşılıklara rağmen rakiplerinin üzerinde öz kaynak karlılığı üretebiliyor. Karşılıkların normalize olduğu ortamda bankanın öz kaynak karlılığı çok rahat %17-18 düzeyini yakalayacaktır. 2019 yılı için yatay %4’lük yıllık kar düşüşü beklerken, önümüzdeki yıl için %44 seviyesinde bir net kar artışı tahmin ediyoruz.</p><br> <p><b>Katalizör</b></p><br> <p> Faiz indirimlerinin devam edecek olması bankanın zaten güçlü marj yapısını daha da kuvvetlendirecek. Düşük faiz ortamı ve kurda sağlanan görece istikrar bankanın kredi büyüme iştihanı artıracaktır. </p><br> <p> </p><br> <p><b>Riskler</b></p><br> <p> Ekonomide ani yavaşlama ve/veya TL’de ani ve keskin değer kaybı bankanın sermaye yeterlilik ve aktif kalite yapısında bozulmalara neden olabilir.  p><br>",
