        '"<p><b>Yatırım Teması</b></p><br>\nAlbaraka için 2021 yılı özellikle marj baskısının hissedilerek başlandığı bir dönem oldu. Yüksek seyreden fonlama maliyetleri marjları baskılarken karlılığı pozitif alanda tutan olgu karşılık giderlerinin görece düşük seyri oldu. 2019-20 döneminde yoğun şekilde hissedilen aktif kalite probelemlerinin bu sene daha az hissedileceği bir yıl olacak. Yine de karlılıktaki güçlenme ancak yılın sonlarına doğru kredi protföyünün tam anlamıyla yeniden fiyatlamasından sonra gerçekleşebilecek. Bu sene fonlama maliyet baskılarının ve geçen yıllarda karlılığı çok destekleyen net tiacri gelirleirn bu sene zarar olarak yazılması genel karlılığı olumsuz etkilemeye devam ediyor.\nAlbaraka içinyeni belirlediğimiz hisse değeri TL 1.78 seviyesinde bulunuyor. Banka için TUT tavsiyemizi sürdürüyoruz.\n\n\n\n<p><b>Değerleme</b></p><br>\n\nCazip değerlemeleri rağmen bankanın hisse performansı daha çok aktif kalite gelişimi ve bu sene beklenen karlılık büyüme düzelmesinin ne derece gerçekleştirilebileceği ile ilgili.\n\n\n\n<p><b>Riskler</b></p><br>\nMakroekonomik risklerdeki artışlar, düşük büyüme, aktif kalitesinin bozulması, faiz oranları ve kurdaki oynaklığın artışı bankanın gelir yapısını ve sermaye yeterlilik oranlarını olumsuz etkileyebilir."',
