      ACIKLAMA_TR:
        '"<p><b>Yatırım Teması</b></p><br> <p> Yüksek TL fonlama ve swap maliyetlerinin etkisiyle ilk yarıda marj 2020 ortalamalarına göre 150 baz puan gerileyerek bankanın bu sene ikinci çeyrekten sonra revize ettiği 50baz marj düşüşünün çok üzerinde gerçekleşmiş durumda. Yeniden fiyatlama ve TÜFEX’in daha yüksek oranlarla değerlenmesiye bu marj daralması önümüzdeki çeyreklerde düşecek ancak biz yine de bankanın yılı 100 baz puan civarında swaplara göre düzeltilmiş net faiz marj daralmasıyla bitireceğini tahmin ediyoruz. Marjlardaki baskıyı bir kenara koyarsak bu sene karlılığı destekleyen en önemli unsur güçlü giden aktif kalitesi ve hızla düşen karşılık giderleri. YKB için 2021 net kar tahminimizi %16 oranında arttırdık. Bankanın bu sene hedefledği %15 öz kaynak karlılık rakamına ulaşacağını öngörüyoruz. YKB için hedef değerimizi TL 3.8 olarak belirledik. 2021 ve sonrası kar tahminlerimizi arrtırdığımız için hedef değerde yukarı yönlü bir revizyon olurken bankanın hedefe göre %58 yükseliş potansiyeli bulunuyor.\n </p><br> <p><b>Katalizör</b></p><br> <p> Yılın ilk yarısında 130 baz puan olarak gerçekleşen risk maliyeti geçen yılki yaklaşık 300 baz puan ortalamanın çok altında seyretmeye devam ediyor. Bankada sene başında 200 baz puan altında kalacağını öngördüğü risk maliyetini yarıyılın sonunda 150 baz puanın altında kalıra revize etti. Yılın kalan kısmında da bu eğilimin devam etmesini ve bankanın bütçelediği rakamın çok altında bir karşılık gideri yazmasını bekliyoruz. Yine beklentilerden daha iyi gelişen net ücret ve komisyon giderleri, iştirak gelirleri genel karlılığı destekleyecek diğer unsurlar. \n</p><br> <p> </p><br> <p><b>Riskler</b></p><br> <p> Ekonomide ani yavaşlama ve/veya TL’de ani ve keskin değer kaybı bankanın sermaye yeterlilik ve aktif kalite yapısında bozulmalara neden olabilir.  p><br>"',
      ACIKLAMA_ENG:
        "Higher funding and swap costs heavily weighed on the margins in 1H21, pulling down the swap adj. NIM by 150bps on YtD basis, which is quite far from the bank’s initial guidance of 50bps at the beginning of the year. The bank has recently started to see margins recovering with the re-pricing and CPI linker impacts which will be more visible through the end of the year. We foresee 100bps margin erosion on swap adj. Basis at the end of the year. Despite the margin pressures, the bank maintained its NII and overall earnings momentum thanks to lucrative growth both on the credit and funding markets. Lower provision expenses has also been the main trigger for the NI growth for this year where the bank booked merely 130bps net CoR in 1H21, vs 300bps average of 2020, being markedly lower than the initial guidance of remaining below 200bps for the full year. This prompted the management to revise down its CoR guidance to bring lower than 150bps for 2021.  Better than expected evolution in net fee income and subsidiary contribution should also be underlined for the benign earnings momentum for this year.",
