        "p><b>Yatırım Teması</b></p><br> <p> Akbank üçüncü çeyrek itibarıyla BDDK’nın direktifi doğrultusunda bankaların takip hesaplarına atmaları gereken kredilerinin büyük kısmını takip hesaplarına intikal ettirdi. Son çeyrekte bu listeden birkaç dosya daha takibe atılacak ama bankanın sene başında verdiği takip oranının %6’nın altında kalma hedefi tutturulacak. Faiz indirimlerine marjların tepkisi gayet olumlu. TÜFEX gelirlerindeki zayıflamaya rağmen marj artışının son çeyrekte de sürmesini bekliyoruz. Ayrıca ücret ve komisyon gelirlerinin güçlü seyri genel karlılığı oluşu etkilemeye devam ediyor.</p><br> <p> Bankanın sermaye yeterlilik oranlarının yüksek oluşu, 2. Grup kredilerde bulunan enerji ve gayrimenkul kredi riskleri için yüksek karşılık politikasının sürdürülmesi ve TTKOM kredisi için muhafazakâr karşılık politikasının devamı, bankanın koruma tamponlarının güçlü oluşunu ortaya koyuyor. 2020 için kar artış beklentimiz %32 seviyesinde. Karşılıkların normalize olduğu ortamda bankanın öz kaynak karlılığının iki sene sonunda tekrar %15 seviyesine yükselmesini bekliyoruz.</p><br> <p><b>Katalizör</b></p><br> <p> Faiz indirimlerinin devam edecek olması bankanın zaten güçlü marj yapısını daha da kuvvetlendirecek. TTKOM hisselerinin olası bir satışı veya bu şirketin hisse değerinin artışı Akbank’a olumlu yansıyacaktır </p><br> <p> </p><br> <p><b>Riskler</b></p><br> <p> Ekonomide ani yavaşlama ve/veya TL’de ani ve keskin değer kaybı bankanın sermaye yeterlilik ve aktif kalite yapısında bozulmalara neden olabilir.  p><br>",
      ACIKLAMA_ENG:
        "<p><b>Investment Case</b></p><br>\n<p>Akbank has strong buffers to withstand to even abrupt deterioration in growth dynamics and asset quality outlook of the system. The bank’s strong core funding base and uncontested cost efficiency are other strongholds to support the ongoing swift recovery in profitability. Its robust capital base is another asset to stay ahead of competition in loan volume growth. </p><br>\n<p><b>Catalyst</b></p><br>\n<p>The recent overhang owing to Otas risk will likely turn out to be exaggerated as the value of collateral is only missing 20% of the full exposure. Also, the underlying risks is on a flagship company where involved parties have strong financial muscle i.e. Saudi Telecom and Turkish Treasury. Any potential recoveries from this file could positively reflect to Akbank’s market value. </p><br>\n<p>management targets 1.7% RoA with 9.0x leverage, indicating a 15% RoE and c.10% EPS growth on annual basis in 2017 (Is Investment estimates: 1.8% RoA, 15.4% RoE and 10% EPS growth). In the mid-term, the management expect RoA to sail around 1.7-1.9% level and RoE of 15-17%, indicating an improved operating environment compared to the previous year expectations. </p><br>\n<p><b>Valuation</b></p><br>\n<p>The stock trades at 6.4x 17E P/E and 0.9x to its estimated 2017 BV based on Bloomberg Consensus, corresponding to 31% discount to MSCI EM financials. </p><br>\n<p><b>Key risks</b></p><br>\n<p>The bank is exposed to slowdown in economic activity through asset quality channel and facing higher earnings volatility. </p><br>",
