      ACIKLAMA_TR:
        '"<p><b>Yatırım Teması</b></p><br> <p>2020 yılında düşük verimlerle verilen yüksek montanlı krediler son üç çeyrektir marjları çok olumsuz bir biçimde baskılıyor. Özellikle ilk çeyrek net faiz gelirlerinin negatif olarak gelmesi bu etkinin boyutunu gözler önüne sermekte. Banka, TÜFEX portföyünün gelirlerini yüksek tutmak adına %15 enflasyon varsayımı kullanmasına rağmen negatif net faiz gelir rakamını önleyememiş durumda. Bundan sonraki çeyreklerde net faiz gelirininin ve marjın kademeli iyileşmesini beklemekle beraber bu seneki marj baskısı nedeniyle net kar da olumsuz etkilenecek. Bu nedenle Halkbank için 2021 net kar tahminimizi TL 3 milyar seviyelerinden TL 1.2 milyara aşağı yönlü revize ettik. Yüksek TL fonlama baskısı ve TL kredi stoğunun düşük verimi ortalamasının devam etmesi nedeniyle net faiz gelir beklentimizi önemli derecede aşağı yönlü revize ettik. 2021 ve 2022 net kar tahminini önemli derecede aşağı yönlü revize ederken 2023 ve sonrası için tahminlerimizde çok değişikliğe gitmedik. Banka için yeni hedef değerimiz TL 5.21 seviyesi olarak belirlerken önerimizi ise AL’dan TUT’a çekiyoruz. Bankanın bilançosundaki düşük verimli getirili aktif baskısının orta ve uzun vadede de marj üzerinde baskı yaratarak öz kaynak karlılığını aşağıya çekmesini öngörüyoruz. Bütün bu olumsuz koşullara rağmen hisse fiyatının bahsedilen konuların önemli bir bölümünü de fiyatladığı bir başka gerçek. BDDK’nın pandemi sonrası getirdiği özellikle SYR ve aktif kalite konusunda bankaları rahatlattığı kuralların geçerlilik süresini uzatması da Halkbank için önemli bir olumlu nokta. \n\n </p><br> <p><b>Katalizör</b></p><br> <p> Kamu bankalarını hükümetçe verilen destekler genişleyerek artabilir, bu da bankanın fonlama maliyetlerinin daha rekabetçi olmasını sağlayacaktır..</p><br> <p> </p><br>\n"',
      ACIKLAMA_ENG:
        "Very rigorous loan growth at utterly lower yields that ware realized in 2020 have been denting the margins for Halkbank for the last three quarters. The impact could be grasped easily as the 1Q21 NII turned negative for the bank. This was faced even after employing higher inflation assumption at 15% used  for its CPI linker portfolio in 1Q21. Although we pencil in gradual margin recovery in the quarters to come, this will be far away to save the sheer margin pressure on overall earnings this year. The reason why the bank’s NI remained green in 1Q21 was that it aggressively reversed the previously provided provisions to record gains. That said, the bank will be meagerly feeling the pressure of provision expenses in 2021.",
