      ACIKLAMA_TR:
        '"<p><b>Yatırım Teması</b></p><br> <p> Vakıfbank’ın ilk yarıda net faiz marjı 130 baz aşağı gelerek karlılığı önemli bir biçimde baskıladı. Ancak, bankanın ilk çeyrekte TL 400mn serbest karşılık ayırdığını ve kredi portföyü için muhafazakar yaklaşımını sürdürdüğünü görüyoruz. Marjlar yılın geri kalanında özellikle ikinci yarıda önemli bir biçimde toparlayarak bu sene için %3 ortalama düzeyine gelecek.Banka için 2021 yılı net kar rakamımızı ikinci çeyrek sonuçlarından sonra bir miktar daha aşağı yönlü revize ederek TL 3 milyar seviyesine çektik. Vakıfbank’ın burada özellikle ikinci yarıda kullanabileceği önemli bir TÜFEX ek getiri potansiyeli bulunuyor. Banka ilk çeyrekte %9.5, ikinci çeyrekte %14 enflasyonvarsayımı kullanmıştı. Bunu en az 300-400 baz puan yukarıyadoğru güncelleyerek buradan gelen getiriyi önmeli biçimde yukarı çekecek. Kamu bankaları içerisinde gerek fonlama yapısı gerekse aktif kalite risklerine karşı son derece muhfazakar yaklaşımı bankayı bir adım ön plana çıkarıyor. İkinci yarıyla birlikte marjlarda toparlanma sinyallerini almaya başlayacağız. Bu arada karşılık giderlerinin baskısı da oldukça mutedil olarak seyretmeye devam ederek genel karlılığa çok olumlu katkı yapmaya devam edecek.\nAşağı yönlü kar revizyonlarından sonra banka için hedef piyasa değerimizi TL 5.5 seviyesinden TL 4.8  seviyesine çekiyoruz.\n </p><br> <p><b>Katalizör</b></p><br> <p> Bankanın net ücret ve komisyon gelirleri de büyümenin görece yavaş gittiği bir ortamda oldukça iyi bir performans göstererek genel karlılığa katkıda bulunmaya devam ediyor. Tahsilatların çok güçlü seyriyle net takibe atılan miktar negatife dönerek aslında karlılığa önemli katkıda bulundu.\n </p><br> <p> </p><br> <p><b>Riskler</b></p><br> <p> Ekonomide ani yavaşlama ve/veya TL’de ani ve keskin değer kaybı bankanın sermaye yeterlilik ve aktif kalite yapısında bozulmalara neden olabilir.  p><br>"',
      ACIKLAMA_ENG:
        "Vakıfbank’s swap adj. NIM retreated by 130 bps in the first half putting a major drag on overall earnings structure in 1H21. Yet, the earnings were also pressurized by the bank’s conservative approach in asset quality where it set aside TL 400mn free provision along with the regular provision expenses for its all loan stages. Although 1Q21 has dipped below 2% in 1Q21, the progress we expect in the margins of the upcoming quarters will lift the overall NIM average to 3% for the full year. Furthermore, the bank is also getting a decent contribution from its fee earnings base to its overall profitability. Net NPLs turned negative in 1H21 on the back of the vigorous collection performance.",
