      ACIKLAMA_TR:
        '"p><b>Yatırım Teması</b></p><br> <p> TSKB, göreceli olarak baskılanan marj ortamından en az etkilenen banka görünümünü korumaya devam ediyor. Kredi portföyünün önemli kısmının yabancı para cinsinden olması YP kredi spredlerindeki yüksek seviyenin korunmaya devam etmesi marjlar için önemli bir savunma duvarı oluşturuyor. Göreceli oalrak TL aktiflerin toplam bilançodaki düşük sevieysi TL fonlama ihtiyacını azaltıyor. Bunun yanında TÜFEX portföyünden yukarı yönlü getiri güncellemeleri de nmarjlar için önemli bir kalkan oluşturmuş durumda. Marjların güçlü duruşu bankanın kredi portföy kalitesinin yüksekliği TSKB’nin yılı kuvvetli bir öz kaynak karlılığı ile bitereceğini gösteriyor. Ticari bankaların yeni YP kredi vermedeki süren iştahsızlığı da aslında bankaya aktif kalitesi son derece yüksek potansiyel müşteri adaylarına YP kredi plasman imkanının arttırıyor. Bu hem karlılık hem de kredi riski için son derece olumlu bir gelişme. \nBanka için 2021 ve 22 dönemi kar tahminlerimizi yükselttik. Bunun yanında TSKB için yeni hedef değerimiz TL1.80 olarak belrilerken önerimizi ise TUT’tan AL’a çekiyoruz.\n</p><br> <p><b>Katalizör</b></p><br> <p> Her ne kadar uzun vadeli yatırımlar askıya alınmış da yatırımlar da ertelenmiş projelerin devreye girmesiyle sağlanacak ivmelenme bu segmentte çok iyi konumlanmış TSKB için çok önemli fırsatlar sunuyor. </p><br> <p> </p><br> <p><b>Riskler</b></p><br> <p> Ekonomide ani yavaşlama ve/veya TL’de ani ve keskin değer kaybı bankanın sermaye yeterlilik ve aktif kalite yapısında bozulmalara neden olabilir.  p><br>"',
