      ACIKLAMA_TR:
        '"<p><b>Yatırım Teması</b></p><br> <p> Sektör dinamikleri özellikle son yasal düzenlemelerden sonra son derece olumlu yönde ilerlemeye devam ediyor. Teknik karlılık olarak hayat branşında ilk yarıda bir miktar zayıflık görülse de Hairan’dan sonra bu segmentin önemli derecede toparlandığını görüyoruz. Emeklilik tarafının güçlenen teknik kar tablosu da ana faaliyet gelirlerinin güçlü seyretmeye devam ettiğini gösteriyor. Şirketin yüksek karlılığının devam etmesini bekliyoruz. Özellikle yeni düzenlemelerden sonra emeklilik tarafında yüksek karlılığın devam etmesini beklerken, hayat tarafında ise kademeli kredi artışının yanında yeni ürünlerin büyümeye katkısının artması bu tarafın teknik kar marjlarını da yüksek tutmaya devam edecek. Şirket için hedef fiyat değerimizi TL13 olarak korurken Anadolu Hayat için AL tavsiyemizi sürdürüyoruz. \n</p><br> <p><b>Katalizör</b></p><br> <p> Kıdem tazminatlarının BES’ e devredilmesi konusu somutlaşırsa sektör fonlarının büyümesi açısından katalizör etkisi yapabilir. </p><br> <p> </p><br> <p><b>Riskler</b></p><br> <p> Ekonomide ani yavaşlama ve/veya TL’de ani ve keskin değer kaybı BES’ten çıkışları artırabilir, hayat tarafında prim üretim büyümesini olumsuz etkileyebilir. p><br>"',
      ACIKLAMA_ENG:
        "The sector dynamics is heading towards in a right direction especially after the latest regulatory changes allowing minors to enroll in the private pension system. Although we observe a setback in the superior life segment profitability owing to slower loan growth in 1H21, the premium growth is back on track starting from June. Improving technical income from life branch, higher technical profitability of the pension segment and higher interest income on its own funds offset the momentum drop in revenues from life in the first half.  The company maintains its higher profitability. We retain our TL 13 TP for the name. Its superior RoAE and a sustained dividend payments make it an exceptional investment choice for investors looking for growth and profitability combination.",
