      ACIKLAMA_TR:
        '"<p><b>Yatırım Teması</b></p><br> <p> İlk yarı kombine oranlarının artışı hasarların trafik ve sağlık segmentinde beklentilerden hızlı bir biçimde normalleşmesi ve hatta normal seyrinin de üzerine çıkarak teknik karı baskılaması sonucunda oluştu. Şirketin mali karı Anadolu Hayat’tan alınan güçlü temettü geliri ve yüksek faizler nedeniyle beklenildiği gibi çok yüksek gerçekleşerek toplam karlılığı destekledi. Şirketin prim üretim büyümesi %25’nin üzerinde gerçekleşerek pazar paylarının korunduğunu gösteriyor. Trafik segmentinde geçen yılın sonlarına doğru oluşan mevzuat ile ilgili belirsizlik şirketin teknik sonuçlarını ilk yarıda olumsuz etkiledi. Bununla birlikte bu konuda getirilen çözümle beraber en azından yılın ikinci yarısında mevzuat ile ilgili sözkonusu karışıklık giderildi. Ayrıca ekonomideki toparlanmanın da prim büyümelerini olumlu etkilediğini görüyoruz.  Şirket için hedef fiyatımız TL7.86 ve TUT tavsiyemiz devam ediyor.\n</p><br> <p><b>Katalizör</b></p><br> <p> Zorunlu sigorta kapsamının genişlemesi elementer branşlarda faaliyet gösteren sigorta şirketleri açısından bir fırsat teşkil ediyor. Özellikle trafik segmentinde düşen hasar frekansları ise toplam kombine oranların aşağıya çekilmesi açısından bir zemin teşkil ediyor. </p><br> <p> </p><br> <p><b>Riskler</b></p><br> <p> Ekonomide ani yavaşlama ve/veya TL’de ani ve keskin değer kaybı şirketlerin prim üretimlerini düşürebilir ve hasar oranlarını olumsuz etkileyebilir.  p><br>"',
      ACIKLAMA_ENG:
        "Higher loss frequencies in health and traffic branches dented the technical results in 1H21, inflating the combined ratio over the average of the recent periods. Weak TL, higher spare part costs and increased traffic activity have been fuelling the loss frequencies throughout 2021. This was mainly balanced out by the superior results obtained from the investment portfolio, which was further buoyed by the higher dividend income received from Anadolu Hayat back in 1Q21.  The premium growth was realized above 20%, reinstating that the company preserved its market shares despite the stiffer competition.  The regulatory ambiguity related with traffic segment loss payments was cleared out and we expect some part of the spike in combined ratio will get normalized. We maintain our HOLD recommendation for Anadolu Sigorta with a target price of TL 7.86 per share.",
