      ANALIST: "Dr.Bülent Şengönül",
      ACIKLAMA_TR:
        "Şirketin prim üretim büyümesi beklentilerimizden daha iyi gelişiyor. 2021 için TL 9.8 milyarlık prim üretim tahminimiz muhtemelen yıl sonunda önemli miktarda aşılmış olacak. Ayrıca Türkiye Sigorta’nın marjlarının ilk çeyrekteki sektörel olumsuzluklara rağmen özellikle karşılaştırmalı olarak son derece yüksek kalmaya devam ettiğini görüyoruz. Trafik  branşlarında şirketin pazar payları artıyor. Güçlü konumda bulunulan branşlarda ise sektör liderliği korunuyor. Güçlü prim üretiminin korunması, teknik marjlarda rakiplere ve tarfikteki ağırlığın artmasına rağmen yüksek seviyelerin korunması ve mali karın genel karlılığı destekliyor oluşu sene sonu net kar tahminimiz için de yukarı yönlü olumlu bir risk oluşturuyor. Şirketin kuvvetli temettü ödeme kabiliyeti de bu güçlü karlılığın değerlemelere yansıması gerektiğini bize söylüyor.",
      ACIKLAMA_ENG:
        "The premium growth evolves better than what we estimate at the onset of 2021. Our 2021 gross premium target of TL 9.8 bn. will be markedly exceeded by the end of the year. On the other hand, the technical profitability of the company remained utterly strong in an environment where the technical income of the other competitive insurers got soured visibly. The company maintains its leadership in an already strong branches while it increases its footprints in several segments i.e traffic and health.  Keeping robust premium generation, outnumbering the rivals on the technical margin indicators and strong financial income evolution are all forming a good base for likely seeing upside risks to our earnings estimate for this year. As a high dividend payer, Turkiye Sigorta’s valuation metrics should be positively impacted from the benign profitability outlook.",
