      ANALIST: "Dr.Bülent Şengönül",
      ACIKLAMA_TR:
        '"<p><b>Yatırım Teması</b></p><br> <p> Şirketin teknik kar marjı ilk yarı sonunda uzun süreden sonra artan (normalleşen) hasarlar ile tarihi ortalamalarının altına geriledi. Ayrıca şirketin trafik branşlarında sektör liderliğini yakalaması ve burada hasar şiddetlerinin artması da kombine oranı tarihi ortalamalarının üzerine çıkaran bir başka faktör. Artan mobilite ve hızla normalleşen hasar frekansları nedeniyle kombine oranlarının yükseldiğini görüyoruz . Yaz aylarındaki yangın ve sel felaketleri sebebiyle de iklim değişikliklerine bağlı felaket hasaralarında bir artış gözlemlendi. Bu durum özellikle üçüncü çeyrek karlılığını olumsuz etkileyecek Yüksek faiz ortamı nedeniyle mali karların güçlenmesi dengeleyici rol oynamayı sürdürüyor. Aksigorta için 2021 yılında bir önceki yıla göre net kar artışı beklemiyoruz ancak şirketin yüksek temettü dağıtım oarnı (karın %60-70 seviyeleri) öz kaynaka karlılığını yüksek seviyelerde tutmaya devam ediyor. Son çeyrek karlılığı karşılık iptalleri nedeniyle güçlü gelebilir. Şirket için hedef fiyat değerimizi TL 10.76 seviyesinde koruyoruz. Aksigorta için AL tavsiyemiz sürüyor.\n. </p><br> <p><b>Katalizör</b></p><br> <p> Zorunlu sigorta kapsamının genişlemesi elementer branşlarda faaliyet gösteren sigorta şirketleri açısından bir fırsat teşkil ediyor. Özellikle trafik segmentinde düşen hasar frekansları ise toplam kombine oranların aşağıya çekilmesi açısından bir zemin teşkil ediyor. </p><br> <p> </p><br> <p><b>Riskler</b></p><br> <p> Ekonomide ani yavaşlama ve/veya TL’de ani ve keskin değer kaybı şirketlerin prim üretimlerini düşürebilir ve hasar oranlarını olumsuz etkileyebilir.  p><br>"',
      ACIKLAMA_ENG:
        "The technical profitability of the company retreated below its historic averages thanks to the higher loss frequencies incurred in several segments. The regulatory impasse in traffic branch which boosted the provision expenses along with several loss files related to hail losses in the Western part of Turkey all dismally impacted the net technical income of the company in 1H21. Third quarter technical results were also under the pressure of loss files arising from the flood and fire catastrophes in the summer months. The company maintains its leadership in traffic segment, which generates higher losses but higher premiums as well in a high interest rate environment. Aksigorta will likely release some of its excess reserves in 4Q21 and will post a rather strong 4Q21 following a possible sluggish 3Q21.  We retain our target price as TL 10.76 per share and maintain our BUY recommendation.",
