      ANALIST: "Emin Yetkin Ertürk",
      ACIKLAMA_TR:
        '"<p><b>Yatırım Teması</b></p><br> <p> Gayrimenkul portföyünün %58’i ofis, %25’i AVM, %9’u Projeler olan şirket için ;COVİD tedbirleri kapsamında çalışma modeli ve ofis kullanım şekillerindeki belirsizliklerin devam etmesi öngörülüyor. Kira portföyünün büyük bir kısmının ofislerden oluşması nedeniyle İş GYO’nun kira gelirleri, salgından sonra evden çalışmaya geçilmesiyle birlikte negatif etkilendi. Finansal anlamda güçlü kiracılar ve uzun vadeli kira sözleşmeleri ile avantaj sağlayan şirketin 2021 yılı kira geliri beklentisi 2020 yılına paralel olarak gerçekleşiyor. 2021’in ikinci yarısında da alışveriş merkezleri ve ticari ünitelere verilen kira desteklerinin devam etmesi bekleniyor ancak aşılamaların hız kazanmasının, AVM’lerdeki ziyaretçi sayısınında olumlu etkisi oldu ve bu durum mağaza ciroları üzerinden kira alınması uygulamaları nedeniyle kira gelirleri üzerindeki baskıyı azaltıyor. </p><br>\n\n<p><b>Katalizör</b></p><br>\n\n<p> Yeni kiralamamlar ile ofis boşluk oranlarında meydana gelebilecek düşüş ve borçluluğun düşürülmesi amacıyla verimli olmayan bazı varlıkların satılması hisse performansını olumlu etkilecektir. </p><br>\n\n<p><b>Riskler</b></p><br>\n\n<p> Makroekonomik koşulların bozulması, zayıf tüketici güveni nedeniyle meydana gelebilecek kiracı kayıpları ve konut talebini azaltacak yeni bir faiz artırımı dönemine girilmesi ana risk unsurları. </p><br>"',
      ACIKLAMA_ENG:
        '"<p><b>Investment Case</b></p><br>\n<p> The negative impact of the pandemics working conditions (working at home model)  will likely alleviate in the periods to come which, we think will be more favorable for Is Reit whose portfolio is composed of 58% office, 25% shopping malls, and 9% projects. Note that, İş REIT\'s rental income was, to certain degree, dismally affected by the shift to work from home after the epidemic. The company, rendering advantageous conditions to its financially strong tenants through long-term lease agreements, expects rental income for 2021 to be realized similar 2020 levels.. p><br>\n\n<p><b>Catalyst</b></p><br>\n<p>. In the second half of 2021, rental supports for shopping malls and commercial units are expected to continue. However, the acceleration of vaccinations had a positive impact on the number of visitors in the shopping malls, which reduces the pressure on rental incomes due to the practices of renting linked to store turnovers. Our revised target price offers an upside potential of 11% with 2.06 TL per share. We reiterate our HOLD recommendation due to limited growth potential. The stock is traded at a 60% discount to its net asset value. The average discount of previous years is at the level of 58%.\n </p><br>\n\n<p><b>Key risks</b></p><br>\n<p> Steady rental income might come under pressure on sharp economic downturns and weakening consumer sentiment as it may delay the lease of currently empty office spaces.  </p><br>"',
