      ANALIST: "Emin Yetkin Ertürk",
      ACIKLAMA_TR:
        '"<p><b>Yatırım Teması</b></p><br>\n<p> Torunlar GYO ofis, alışveriş ve konut projesi yatırımlarıyla ve çeşitlendirilmiş portföyü ile öne çıkmakta. i) Alışveriş merkezleri ve ofis binalarından gelen güçlü ve düzenli kira gelirleri, ii) yoğun yatırım döneminin geride kalması ile 2021 yılıda borçluluk seviyesinde azalma başlaması iii) risklerin iyi yönetiliyor olması, ana yatırım temaları olarak öne çıkıyor. \n</p><br>\n\n<p><b>Katalizör</b></p><br>               \n<p>. 2021 yılının ilk yarısında kademeli normalleşmeye geçilmesiyle birlikte AVM ve ofis kira gelirlerinde geçen yılın aynı dönemine göre %26 artış oldu. Net borç ise 2Ç21’de yıllık %4 artışla 4,6 milyar TL olarak gerçekleşti. Özellikle Torun Center ağırlıklı olan satışlar marjları destekliyor.  2021’in ilk yarısında devam eden kira desteklerinin kısıtlamaların azalmasıyla beraber AVM’lerde oluşabilecek canlanmaların etkisiyle azalacağını öngörüyoruz.  2021 yılı kira gelirleri tahminimiz 670 mn TL yıllık %29 artışa işaret ediyor. Ayrıca şirketin borçlarını düşürme sürecinde olması, finansman giderlerinde düşüş beklentisi ve artan kira fiyatlarını önümüzdeki dönemler için olumlu olarak değerlendiriyoruz. Azalan faiz ortamında konut satışlarında yukarı yönlü bir ivmenin önümüzdeki dönemlerde  yakalanabileceğini  tahmin ediyoruz.</p><br>\n\n<p><b>Riskler</b></p><br>\n<p> Açık döviz pozisyonu bulunan yüksek olan şirketin borç seviyesi düşürülene kadar kurdaki dalgalanmalardan olumsuz etkileneceğini düşünüyoruz. Yeni konut talebindeki yavaşlama şirketin konut projelerindeki satış performansı için risk teşkil etmekte. Tüketici güveninde ve turizm sektöründe yaşanabilecek olumsuz gelişmeler ise kira gelirleri için birer risk unsuru. </p><br>"',
      ACIKLAMA_ENG:
        '"p><b>Investment Case</b></p><br>\n<p> Torunlar REIC stands out with its office, shopping and residential project investments and its diversified portfolio. Sales revenue distribution of Torunlar is 47% rental revenues and 43% housing sales revenues. With the gradual normalization in 1H2021, shopping mall and office rental income increased by 26% YoY. Net debt realized at 4.6 bn TL, up by 4% YoY. Margins are supported by mainly Torun Center-based sales.   </p><br>\n\n<p><b>Catalyst</b></p><br>\n<p> We anticipate that the rental support, which was intact in the first half of 2021, will decrease to a great extent with the effect of the recovery in shopping in malls as the restrictions abolish. We predict that the rental income will increase by 29% YoY to 670 mn TL in 2021. In addition, we consider the company\'s ongoing deleveraging process, the expectation of a decrease in financial expenses and the increasing rental prices for the coming periods as positive. We think that the acceleration in residential unit sales in the upcoming period due to declining interest rate. </p><br>\n\n<p><b>Valuation</b></p><br>\n<p> . After the revisions in our macro assumptions, we are revising our target price as 4.32 TL per share. We reiterate our HOLD recommendation for TRGYO due to the loss in rental income, high indebtedness, and limited growth potential. The stock is traded at a 57% discount to its net asset value (historical average discount: 58%).\n\n</p><br>\n\n<p><b>Key risks</b></p><br>\n<p> Until the deleveraging is completed, the company will remain vulnerable to potential currency shocks as the Company has short fx position.  Political and regional risks might exacerbate weakening in consumer sentiment, tourism and hence footfall to shopping malls. </p><br>"',
