      ANALIST: "Emin Yetkin Ertürk",
      ACIKLAMA_TR:
        '"<p><b>Yatırım Teması</b></p><br> <p> Emlak Konut, tarihi düşük seviyeye düşen konut kredisi faiz oranları ve uzun ödeme vadeleri ile Haziran ayında başlattığı cazip satış kampanyası ile 2020 yılında 10,908 adet satıştan 15.1 milyar TL ön satış gelirine ulaşmıştı. Kampanyanın finansmanının büyük bir oranda bankalar tarafından yapılması nedeniyle Şirket nakit satışlarının toplam satışlar içerisindeki payı geçen seneki %25-30 seviyelerinden %42’ye yükselmişti. 2021 yılı hedefi olarak 11 milyar TL ön satış hedefi açıklayan Şirket, 3Ç21’de 3829 bağımsız ünite satışından 9.36 milyar TL ön satış geliri elde etti. Bu satışla firma çeyrek bazlı yillik hedefini %15 oranında aştı. Ilk yarıyıl şirket yıllık hedefinin ise %18 üzerinde kapattığını hatırlatmak isteriz. Faiz indirimi uygulamalarının devam etmesi beklentisiyle yılın 4. çeyreğinde de konut talebinin canlanmasını bekliyor ve  şirketin 11 milyarlık ön satış hedefinin üzerinde sonuç açıklayacağını düşünüyoruz.\nPandeminin etkisiyle günlük yaşam merkezinin konut bünyesinde toplanması bu dönemde sektörün hareketli kalmasını desteklemekle beraber konut tercihlerinde belirgin değişiklere neden oldu. Şehrin dışında yeşillik alanlarda kalan, sosyal tesisleri içerisinde barındıran daha geniş evler daha çok tercih edilirken Emlak Konut’un bu tarz projeler üzerinde yoğunlaşması satışlarının güçlü seyretmesine katkı sağlıyor.\n </p><br>\n<p><b>Katalizör</b></p><br> <p> Konut kredisi faizlerinin aylık %1.37 seviyelerine kadar yükselmesi Şirket’in ön satış performansı ve nakit üretimi üzerinde baskı oluşturuyor. Bu durumun, Şirket’in ön-satışları desteklemek adına vadeli satış yöntemlerine ağırlık vermeye devam ediyor. Diğer yandan, geçmiş yıllarda yapılan vadeli satışlardan kaynaklanan ticari ve bilanço dışı alacakların tahsili ve faiz giderlerindeki düşüşün nakit akışını desteklemeye devam etmesini bekliyoruz. \n </p><br>\n<p><b>Riskler</b></p><br>\n<p> i) Makroekonomik koşulların bozulması ii) konut talebini azaltacak yeni bir faiz artırımı dönemine girilmesi iii) likidite sıkıntısı yaşayan ve inşaatları tamamlamakta zorlanan yüklenicilerin proje teslimlerini geciktirmesi iv) devam eden büyük ölçekli projelerin iptali. </p><br>"',
      ACIKLAMA_ENG:
        "\"p><b>Investment Case</b></p><br>\n<p> Emlak Konut realized a pre-sale revenue of TL15.1 billion from 10.908 units in 2020 with the attractive sales campaign started in June 2020 with housing loan interest rates that fell to historically low levels with longer payment terms. The share of the company’s cash sales in total sales increased to 42% from 25-30% level, as the financing of the campaign was mostly done by the banks. Announcing a pre-sales target of 11 billion TL as its target for 2021, the company achieved pre-sales revenue of 9.36 billion TL from the sales of 3829 independent units as of 3Q21. After this sale performance, the company exceeded its quarterly annual target by 15%. We would like to remind you that the company exceeded its annual target by 18% in the first half of 2021. Due to the expectation that the interest rate cuts will continue, we expect the housing demand to recover in the 4Q21 and we think that the company will likely announce a figure above the 11 billion pre-sales target in 2021.\n \nThe time spent in residential houses during the pandemics escalated significantly further fueling the demand for these units.  As larger houses, which are located in green areas outside the city and include social facilities, are more preferred now, Emlak Konut's high concentration on such projects come to the fore as the company’s competitive edge.\n.</p><br>\n\n<p><b>Catalyst</b></p><br>\n<p>The rise in mortgage rates up to 1.4-1.5% per month has been putting pressure on the company's pre-sales performance and cash generation. Due to this situation, the company continued to focus on forward sales methods to support pre-sales. On the other hand, we expect the collection of trade and off-balance sheet receivables resulting from forward sales made in previous years and the decrease in interest expenses to continue to support cash flow. The Central Bank’s recent move to cut the rates will be lowering the mortgage rates gradually which will have much visible impact on the sales next year.\n</p><br>\n\n<p><b>Valuation</b></p><br>\n<p> At its current market value, the stock is trading at 64% discount to its NAV compared to its historical average of 46%. We maintain out BUY recommendation with our new 12-month TP of TL2.51/share.. </p><br>\n\n<p><b>Key risks</b></p><br>\n<p> Slowdown in economy, decrease in housing demand and prices and hike in interest rates are the main risks for the stock. Although periodically initiated small campaigns have been backing up the housing demand, larger scale campaigns offering extended maturities and interest rate subsidies may delay future cash flows. Also, week tender performance (below 1.80x) would be another downside risk for Emlak. </p><br>\"",
