      ACIKLAMA_TR:
        "<p><b> Yatırım Teması </b></p><br>\n\n\n<p> Alarko Holding son yıllarda enerji sektörüne yapmış olduğu yatırımlar ile enerji sektöründe önemli bir oyuncu haline geldi. Holding’in Net Aktif Değerinin (NAD) %50’si enerji varlıklarından oluşmaktadır. Meram Elektrik Dağıtım ile Konya ve çevresinde elektrik dağıtım faaliyeti gösterirken, elektrik üretim sektöründe de 1.539MW kurulu güce ulaşmıştır. Enerji’den sonraki en önemli iş kolu taahhüt sektörüdür. Son dönemde Türkiye’de ve yurtdışında yeni imzaladığı projeler ile sipariş büyüklüğünü artırmıştır.Elektrik dağıtım sektöründe avantajlı tarifeler ile güçlü ve öngörülebilir büyüme sergilemektedir. Enerji dağıtım sektöründe faaliyet gösteren Şirketler arasında güçlü bilanço yapısı ve görece yüksek serbest nakit akışı ile dikkat çekmektedir. Varlık tabanının büyümesi ile birlikte karlılığın ve nakit akışının önümüzdeki dönemlerde güçlenerek devam etmesini beklemekteyiz. Elektrik fiyatlarındaki yükseliş ve ithal kömür fiyatlarındaki düşüş 1320MW kurulu güce sahip Karbiga ithal kömür santrali için görünümü oldukça iyileştirdi. Ancak COVID-19 tüketimin daralması ve fiyatların düşmesi karlılık üzerinde olumsuz etki yaratacaktır. Elektrik üretim tarafında Karakuz HES ile 10 yıl boyunca dolar bazlı sabit fiyat avantajı olması öngörülebilirliği artırmakta ve TL’nin değer kaybına karşı koruma sağlamaktadır. Taahhüt segmentinde hem Türkiye’de hem yurt dışında yeni projeler kazanması ile birlikte önümüzdeki dönemde bu segmentin konsolide gelirlere ve operasyonel kara katkısında iyileşme öngörüyoruz. Operasyonel olarak uzun vadede büyüme ve karlılık anlamında olumlu olmakla birlikte, kısa vadede COVID-19 sonrası elektrik tüketiminin ve elektrik fiyatlarının düşmesi, TL'nin değer kaybı ve daralan NAD iskontosu hisse üzerinde baskı yaratabilir. </p><br>",
      ACIKLAMA_ENG:
        "<p><b>Investment Case</b></p><br>\n<p> We like the name on: i) the favorable regulatory tariff period in electricity distribution business to boost growth and profitability; ii) the generation arm benefits from US$ based premium pricing; iii) 1320MW Karabiga imported coal type TPP is expected to be value accretive, iv) recently signed projects in contracting segment is expected to boost growth of the segment along with a margin improvement. </p><br>\n<p><b>Catalyst</b></p><br>\n<p> The profitability and cash generation of Meram, electricity distribution&retail arm, significantly improved in recent years on the back of favorable 3rd regulatory tariff period (2016-2020). The favorable tariffs along with increasing regulatory asset base (RAB) is expected to continue to support strong growth and profitability in upcoming years. We expect EBITDA to grow at a CAGR of c.25% until 2020 with an improving cash yield. The RAB, doubling to TL1.5bn at YE20, will continue to be the major source of the profitability and cash generation afterwards. </p><br>\n<p> Karakuz HEPP (76MW) is the major source of the profitability in generation. The entire output of the plant, which we pencil in 240mnKWh, will be selling at a State guaranteed price of US$73/MWh until 2025. We estimate the plant to generate US$15.5mn of annual EBITDA for this period. </p><br>\n<p> Potential new contract awards in contracting, planned hotel investment in Cyprus and any move to crystalize the value of its land bank are short-midterm catalysts. </p><br>\n\n<p><b>Key risks</b></p><br>\n<p> Depreciation of TL has a negative impact on the operational profitability of the Karabiga TPP due to the currency mismatch between revenues and cost as it will sell the output in TL terms while procure the most important input coal in US$ terms. On top of this due to the FX based investment loan of the plant, depreciation of TL results in FX losses for the Company and therefore for the Holding. Lower than expected project additions in contracting segment, further decline in electricity prices and/or rise in coal prices, any additional regulatory burden on coal TPPs and in distribution business are other major downside risk factors.  ip><br>",
