        '"<p><b> Yatırım Teması </b></p><br>\n\n\n<p> : Holding’in net aktif değerinin coğrafya, sektör ve iştirak bazında çeşitlendirilmiş olması, güçlünen solo nakit pozisyonu, iştiraklerinden elde ettiği temettü gelirlerinde artış, dolar bazlı gelirlerin ağırlığının yüksek olması, önemli bir kur riski taşımıyor olması ve cazip değerlemesinden dolayı KCHOL hissesini uzun vadede beğeniyoruz. Son 5 yılda büyük ölçüde halka açık iştirakleriyle 11 milyar doların üzerinde yatırım yapan ve son dönemde halka açık iştiraklerinin yanısıra halka açık olmayan iştiraklerinin de hem organik hemde inorganik olarak yatırımlarına devam etmesini (Kalamış Yat Limanının özelleştirme ihalesinin kazanılması, elektrik üretim ve araç kirama işlerindeki satın almalar) Holding’in yatırım iştahını göstermesi ve uzun vadede büyümeyi destekleyecek olması nedenleriyle olumlu buluyoruz. \n\n<p><b> Katalizör </b></p><br>\n\n\n<p> Holding’in hisse geri alım programının hisseye olan güveni artıracağını ve aşağı yönlü riskleri sınırlayacağını düşünüyoruz. İskonto oranının geldiği seviyeler holding hissesinin iştirak hisselerinden daha cazip olduğuna işaret ediyor.</p><br>"',
