      ACIKLAMA_TR:
        '"<p><b> Yatırım Teması </b></p><br> \n<p> Ana iş kolları içecek ve gıda perakende iştiraklerinin değerlemelerini cazip bulmamız, güçlü ve karlı büyüme öngörülerimiz, güçlenen operasyonel nakit akışları, grup seviyesinde borçluluğun azalması ve Holding’in iştiraklerinden temettü potansiyelinin artması nedenleriyle AGHOL hissesinin iyi bir yatırım teması sunduğunu düşünüyoruz. Holding hissesinin cazip bir yatırım teması sunduğunu düşünmekle birlikte tarihi düşük seviyelerde yer alan iskonto nedeni ile iştirak hisselerinin holding hissesinden daha cazip olduğunu düşünüyoruz.\n</b></p><br> \n<p><b> Katalizör </b></p><br> \n<p>  </p><br> \n<p><b> Riskler </b></p><br>\n<p> Döviz cinsi yüksek borçluluk nedeni ile TL’nin dolara ve euroya karşı değer kaybının en önemli risk unsuru olduğunu düşünüyoruz. Bununla birlikte güçlü operayonel nakit akışı ve varlık satışları sayesinde Holding’in konsolide net borç pozisyonu 2Ç21 itibari ile 1,3 milyar euro seviyesine geriledi (2020: 1,43 milyar euro).   </p><br>"',
      ACIKLAMA_ENG:
        '"<p><b>Investment Case</b></p><br>\n<p> While the current NAV discounts of the leading holdings have widened in the last 2 years, unlike them, the current NAV discount of Anadolu Group Holding has narrowed. We believe its listed subsidiaries are more attractive than the Holding share. We would like to remind you that we have BUY recommendations for its subsidiaries AEFES, CCOLA and Migros shares with relatively high return potentials and catalysts.\n.</p><br>\n<p><b>Catalyst</b></p><br>\n<p> </p><br>\n\n<p><b>Key risks</b></p><br>\n<p> Depreciation of TL against the dollar and euro is the most important risk factor due to high foreign currency indebtedness. However, thanks to strong operational cash flow and asset sales, the Holding\'s consolidated net debt position decreased to €1.3bn as of end-2Q21 (2020: €1.43bn). p><br>"',
